INSERT INTO `items` (`id`, `itemId`, `name`, `description`, `plaintext`) VALUES
	(2037, 3082, 'Warden\'s Mail', '<stats>+40 Armor</stats><br><br><unique>UNIQUE Passive - Cold Steel:</unique> When hit by basic attacks, reduces the attacker\'s Attack Speed by 15% for 1 seconds.', 'Slows Attack Speed of enemy champions when receiving basic attacks'),
	(2038, 3640, 'Flash Zone', '<br><font color=\'#FF9900\'>Allows team to cast Flash repeatedly in a limited zone.</font><br><br>Creates a magic zone for your team for 5 seconds. While in this zone, you and your allies have your summoner spells replaced by an instant cast blink that moves you to any location in the zone (1 second cooldown).', 'Allows you and allies to repeatedly flash while in a zone'),
	(2039, 3089, 'Rabadon\'s Deathcap', '<stats>+120 Ability Power  </stats><br><br><unique>UNIQUE Passive:</unique> Increases Ability Power by 35%.', 'Massively increases Ability Power'),
	(2040, 3087, 'Statikk Shiv', '<stats>+35% Attack Speed<br>+30% Critical Strike Chance<br>+5% Movement Speed</stats><br><br><passive>Passive:</passive> Moving and attacking will make an attack <a href=\'Energized\'>Energized</a>.<br><br><unique>UNIQUE Passive - Shiv Lightning:</unique> Your Energized attacks deal 50~120 bonus magic damage (based on level) to up to 5 targets on hit (deals +120% bonus damage to minions and can critically strike).', 'Movement builds charges that release chain lightning on basic attack'),
	(2041, 3086, 'Zeal', '<stats>+15% Attack Speed<br>+20% Critical Strike Chance</stats><br><br><unique>UNIQUE Passive:</unique> +5% Movement Speed', 'Slight bonuses to Critical Strike Chance, Movement Speed and Attack Speed'),
	(2042, 3085, 'Runaan\'s Hurricane', '<stats>+40% Attack Speed<br>+30% Critical Strike Chance<br>+7% Movement Speed</stats><br><br><unique>UNIQUE Passive - Wind\'s Fury:</unique> When basic attacking, bolts are fired at up to 2 enemies near the target, each dealing (25% of Attack Damage) physical damage. Bolts can critically strike and apply on hit effects.<br><unique>UNIQUE Passive:</unique> Basic attacks deal an additional 15 physical damage on hit.', 'Ranged attacks fire two bolts at nearby enemies'),
	(2043, 3084, 'Overlord\'s Bloodmail', '<stats>+800 Health<br>+100% Base Health Regen </stats><br><br><unique>UNIQUE Passive:</unique> Upon champion kill or assist, restores 300 Health over 5 seconds.', 'Restores Health on kill or assist'),
	(2044, 3083, 'Warmog\'s Armor', '<stats>+800 Health<br>+200% Base Health Regen </stats><br><br><unique>UNIQUE Passive:</unique> +10% Cooldown Reduction<br><unique>UNIQUE Passive:</unique> Grants <unlockedPassive>Warmog\'s Heart</unlockedPassive> if you have at least 3000 maximum Health.<br><br><unlockedPassive>Warmog\'s Heart:</unlockedPassive> Restores 15% of maximum Health every 5 seconds if damage hasn\'t been taken within 8 seconds. ', 'Grants massive Health and Health Regen'),
	(2045, 2303, 'Eye of the Equinox', '<stats>+500 Health<br>+200% Base Health Regen <br>+10% Cooldown Reduction<br>+2 Gold per 10 seconds</stats><br><br><unique>UNIQUE Passive - Spoils of War:</unique> Melee basic attacks execute minions below 320 (+20 per level) Health. Killing a minion heals the owner and the nearest allied champion for 50 Health and grants them kill Gold. These effects require a nearby ally. Recharges every 30 seconds. Max 4 charges.<br><active>UNIQUE Active - Warding:</active> Consumes a charge to place a <font color=\'#BBFFFF\'>Stealth Ward</font> that reveals the surrounding area for 150 seconds. Holds up to 4 charges which refill upon visiting the shop.<br><br><groupLimit>Limited to 1 Gold Income Item.</groupLimit><br><br><rules>(A player may only have 3 <font color=\'#BBFFFF\'>Stealth Wards</font> on the map at one time. Unique Passives with the same name don\'t stack.)</rules>', 'Provides Health and Stealth Wards over time'),
	(2046, 2302, 'Eye of the Oasis', '<stats>+200 Health<br>+100% Base Health Regen <br><mana>+100% Base Mana Regen </mana><br>+10% Cooldown Reduction</stats><br><br><unique>UNIQUE Passive - Favor:</unique> Being near a minion\'s death without dealing the killing blow grants 6 Gold and 10 Health.<br><active>UNIQUE Active - Warding:</active> Consumes a charge to place a <font color=\'#BBFFFF\'>Stealth Ward</font> that reveals the surrounding area for 150 seconds. Holds up to 4 charges which refill upon visiting the shop.<br><br><groupLimit>Limited to 1 Gold Income Item.</groupLimit><br><br><rules>(A player may only have 3 <font color=\'#BBFFFF\'>Stealth Wards</font> on the map at one time. Unique Passives with the same name don\'t stack.)</rules>', 'Provides Regeneration and Stealth Wards over time'),
	(2047, 3512, 'Zz\'Rot Portal', '<stats>+55 Armor<br>+55 Magic Resist<br>+125% Base Health Regen <br></stats><br><unique>UNIQUE Passive - Point Runner:</unique> Builds up to +20% Movement Speed over 2 seconds while near turrets, fallen turrets and Void Gates.<br><active>UNIQUE Active:</active> Spawns a <a href=\'VoidGate\'>Void Gate</a> for 120 seconds (120 second cooldown).<br><br>Every 4 seconds the gate makes a <a href=\'Voidspawn\'>Voidspawn</a>. The first and every fourth Voidspawn gains 15% of maximum Health as damage.', 'Makes a Voidspawn generating Void Gate to push a lane with.'),
	(2048, 2301, 'Eye of the Watchers', '<stats>+200 Health<br><mana>+100% Base Mana Regen </mana><br>+25 Ability Power<br>+10% Cooldown Reduction<br>+2 Gold per 10 seconds</stats><br><br><unique>UNIQUE Passive - Tribute:</unique> Spells and basic attacks against champions or buildings deal 15 additional damage and grant 15 Gold. This can occur up to 3 times every 30 seconds.<br><active>UNIQUE Active - Warding:</active> Consumes a charge to place a <font color=\'#BBFFFF\'>Stealth Ward</font> that reveals the surrounding area for 150 seconds. Holds up to 4 charges which refill upon visiting the shop. <br><br><groupLimit>Limited to 1 Gold Income Item.</groupLimit><br><br><rules>(A player may only have 3 <font color=\'#BBFFFF\'>Stealth Wards</font> on the map at one time. Unique Passives with the same name don\'t stack.)</rules>', 'Provides Ability Power and Stealth Wards over time'),
	(2049, 3630, 'Siege Teleport', '<unique>Active:</unique> Use this trinket to teleport to one of your team\'s port pads. Can only be used from the summoning platform.', 'Provides Ability Power and Stealth Wards over time'),
	(2050, 3751, 'Bami\'s Cinder', '<stats>+280 Health  </stats><br><br><unique>UNIQUE Passive - Immolate:</unique> Deals 5 (+1 per champion level) magic damage per second to nearby enemies. Deals 50% bonus damage to minions and monsters.', 'Grants Health and Immolate Aura'),
	(2051, 3631, 'Siege Ballista', '<br><font color=\'#FF9900\'>Deploys a ballista that shoots the closest turret.</font><br><br>Places a long range ballista if within 2200 range of an enemy turret. After a 5 second delay, it will begin firing at the nearest enemy turret, dealing heavy damage. If the targeted turret expires, the ballista will as well.', 'Place a long range anti-turret ballista'),
	(2052, 3632, 'Siege Ballista', '<br><font color=\'#FF9900\'>Deploys a ballista that shoots the closest turret.</font><br><br>Places a long range ballista if within 2200 range of an enemy turret. After a 5 second delay, it will begin firing at the nearest enemy turret, dealing heavy damage. If the targeted turret expires, the ballista will as well.', 'Place a long range anti-turret ballista'),
	(2053, 3633, 'Siege Teleport', '<unique>Active:</unique> Use this trinket to teleport to one of your team\'s port pads. Can only be used from the summoning platform.', 'Place a long range anti-turret ballista'),
	(2054, 3634, 'Tower: Beam of Ruination', '<br><font color=\'#FF9900\'>Attach, then recast to fire a damaging beam from a turret to your cursor.</font><br><br><font color=\'#FF9900\'>First Cast:</font> Attach a Slayer Beam to the target turret that can be fired 3 times.<br></br><font color=\'#FF9900\'>Next Three Casts:</font> Fires the attached beam towards your cursor, dealing 30/level + 30% of the hit target\'s maximum health (20% damage to minions) in magic damage to all targets in a line.<br></br><br></br>Beam will last 15 seconds, or until it has been fired 3 times.', 'Attaches a three shot beam to a turret which can then be aimed and fired'),
	(2055, 3635, 'Port Pad', '<br><font color=\'#FF9900\'>Deploy an additional teleport target.</font><br><br>Places a Port Pad at target location. After a 4 second delay, it activates, allowing you or your allies to teleport to it from base.', 'Creates another point for your team to Teleport to'),
	(2056, 3636, 'Tower: Storm Bulwark', '<br><font color=\'#FF9900\'>Makes a turret go invulnerable, then rain fire.</font><br><br>Makes the target turret invulnerable for 6 seconds. Two seconds before expiry, it unleashes a missile volley, dealing 2600 true damage over the remaining time to all nearby enemies.<br><br>Cannot be used on the same turret more than once in 15 seconds.', 'Make a turret go invulnerable while charging a powerful barrage'),
	(2057, 3637, 'Nexus Siege: Siege Weapon Slot', 'In Nexus Siege, Summoner Spells are replaced with Siege Weapon Slots. Spend Crystal Shards to buy single-use Siege Weapons from the item shop, then use your Summoner Spell keys to activate them!', 'Make a turret go invulnerable while charging a powerful barrage'),
	(2058, 3092, 'Frost Queen\'s Claim', '<stats>+50 Ability Power<br>+10% Cooldown Reduction<br>+2 Gold per 10 seconds<br><mana>+75% Base Mana Regen </mana></stats><br><br><unique>UNIQUE Passive - Tribute:</unique> Spells and basic attacks against champions or buildings deal 15 additional damage and grant 15 Gold. This can occur up to 3 times every 30 seconds.<br><active>UNIQUE Active:</active> Summon 2 icy ghosts for 6 seconds that seek out nearby enemy champions. Ghosts reveal enemies on contact and reduce their Movement Speed by 40% for between 2 and 5 seconds based on how far the ghosts have traveled (90 second cooldown).<br><br><groupLimit>Limited to 1 Gold Income Item.</groupLimit>', 'Sends out seeking wraiths that track hidden enemies and slow them'),
	(2059, 3091, 'Wit\'s End', '<stats>+40% Attack Speed<br>+40 Magic Resist</stats><br><br><unique>UNIQUE Passive:</unique> Basic attacks deal 40 bonus magic damage on hit.<br><unique>UNIQUE Passive:</unique> Basic attacks steal 5 Magic Resist from the target on hit (stacks up to 5 times.)', 'Deals bonus magic damage on basic attacks'),
	(2060, 3090, 'Wooglet\'s Witchcap', '<stats>+100 Ability Power<br>+45 Armor  </stats><br><br><unique>UNIQUE Passive:</unique> Increases Ability Power by 25%<br><active>UNIQUE Active:</active> Champion becomes invulnerable and untargetable for 2.5 seconds, but is unable to move, attack, cast spells, or use items during this time (120 second cooldown).', 'Massively increases Ability Power and can be activated to enter stasis'),
	(2061, 3098, 'Frostfang', '<stats>+15 Ability Power<br>+2 Gold per 10 seconds<br><mana>+75% Base Mana Regen </mana></stats><br><br><unique>UNIQUE Passive - Tribute:</unique> Spells and basic attacks against champions or buildings deal 15 additional damage and grant 15 Gold. This can occur up to 3 times every 30 seconds. Killing a minion disables this passive for 12 seconds.<br><br><groupLimit>Limited to 1 Gold Income Item.</groupLimit>', 'Grants gold when you damage an enemy with a Spell or Attack'),
	(2062, 3097, 'Targon\'s Brace', '<stats>+175 Health<br>+50% Base Health Regen <br>+2 Gold per 10 seconds </stats><br><br><unique>UNIQUE Passive - Spoils of War:</unique> Melee basic attacks execute minions below 200 (+10 per level) Health. Killing a minion heals the owner and the nearest allied champion for 40 Health and grants them kill Gold.<br><br>These effects require a nearby ally. Recharges every 30 seconds. Max 3 charges.<br><br><groupLimit>Limited to 1 Gold Income Item.</groupLimit>', 'Periodically kill enemy minions to heal and grant gold to a nearby ally'),
	(2063, 3096, 'Nomad\'s Medallion', '<stats>+25% Base Health Regen <br><mana>+75% Base Mana Regen </mana><br>+10% Cooldown Reduction</stats><br><br><unique>UNIQUE Passive - Favor:</unique> Being near a minion\'s death without dealing the killing blow grants 6 Gold and 10 Health.<br><br><groupLimit>Limited to 1 Gold Income Item.</groupLimit><br><br><rules><font color=\'#447777\'>\'\'The medallion shines with the glory of a thousand voices when exposed to the sun.\'\' - Historian Shurelya, 22 June, 24 CLE</font></rules>', 'Grants gold when nearby enemy minions die, Health Regen and Mana Regen'),
	(2064, 3094, 'Rapid Firecannon', '<stats>+30% Attack Speed<br>+30% Critical Strike Chance<br>+5% Movement Speed</stats><br><br><passive>Passive:</passive> Moving and attacking will make an attack <a href=\'Energized\'>Energized</a>.<br><br><unique>UNIQUE Passive - Firecannon:</unique> Your Energized attacks gain 35% bonus Range (+150 range maximum) and deal 50~160 bonus magic damage (based on level) on hit.<br><br>Energized attacks function on structures.', 'Movement builds charges that release a sieging fire attack on release'),
	(2065, 3649, 'Siege Sight Warder', '<groupLimit>Limited to 1 Trinket.</groupLimit><br><br><active>Active:</active> Places a <font color=\'#FFFFFF\'>Stealth Ward</font> that lasts <font color=\'#FFFFFF\'>30</font> seconds (30 second cooldown).', 'Movement builds charges that release a sieging fire attack on release'),
	(2066, 3401, 'Face of the Mountain', '<stats>+450 Health<br>+100% Base Health Regen <br>+10% Cooldown Reduction<br>+2 Gold per 10 seconds </stats><br><br><unique>UNIQUE Passive - Spoils of War:</unique> Melee basic attacks execute minions below 320 (+20 per level) Health. Killing a minion heals the owner and the nearest allied champion for 50 Health and grants them kill Gold. These effects require a nearby ally. Recharges every 30 seconds. Max 4 charges.<br><unique>UNIQUE Active:</unique> Grant a shield to you and an ally equal to 10% of your maximum Health for 4 seconds. After 4 seconds, the shields explode to slow nearby enemies by 40% for 2 seconds (60 second cooldown).  Automatically targets the most wounded ally if cast upon self.<br><br><groupLimit>Limited to 1 Gold Income Item.</groupLimit>', 'Shield an ally from damage based on your Health'),
	(2067, 3641, 'Vanguard Banner', '<br><font color=\'#FF9900\'>Place a banner that buffs minions.</font><br><br>Place a Vanguard Banner at target location. After a 2 second delay, any nearby minions will be granted a buff, increasing their damage by 50%, and granting them 50 Armor and 100 Magic Resistance while within range.', 'Strengthens nearby minions'),
	(2068, 3642, 'Siege Refund', 'Refunds all purchased Siege Weapons for their full price.', 'Refunds all current Siege Weapons'),
	(2069, 3643, 'Entropy Field', '<br><font color=\'#FF9900\'>Stun minions and slow champions in an area.</font><br><br>Places an Entropy Field at target location for 5 seconds.  Enemy minions and Siege Ballistas trapped in the field are unable to move or attack while in the field.  Enemy champions in the field have their Movement Speed reduced by 25%.', 'Places a field that stuns enemy minions and slows champions'),
	(2070, 3645, 'Seer Stone (Trinket)', '<groupLimit>Limited to 1 Trinket.</groupLimit><br><br><active>Active:</active> Reveals a small area within <font color=\'#FFFFF\'>1400</font> range for 3 seconds. Enemy champions will be revealed for 5 seconds (60 second cooldown)', 'Briefly reveals a nearby targeted area'),
	(2071, 3647, 'Shield Totem', '<br><font color=\'#FF9900\'>Place a totem that shields nearby deployables.</font><br><br>Places a Shield Totem at target location. After a 2 second delay, the totem will activate, granting a 2 (+1 per additional Shield Totem) strength shield to all nearby deployables.', 'Grants bonus health to nearby Siege Weapons'),
	(2072, 3648, 'Siege Teleport (Inactive)', '<br><font color=\'#FF9900\'>Place a totem that shields nearby deployables.</font><br><br>Places a Shield Totem at target location. After a 2 second delay, the totem will activate, granting a 2 (+1 per additional Shield Totem) strength shield to all nearby deployables.', 'Grants bonus health to nearby Siege Weapons'),
	(2073, 3416, 'Head of Kha\'Zix', '<unique>UNIQUE Active - Scrying:</unique> Reveals a small location within 4000 range for 2 seconds. Enemy champions found will be revealed for 5 seconds (90 second cooldown).<br><br><unique>UNIQUE Passive - Mementos of the Hunt:</unique> Rengar collects trophies when killing Champions and gains bonus effects based on how many trophies he has. Kills and assists grant 1 trophy.<br><br><passive>3 Trophies:</passive> Rengar gains 25 Movement Speed whilst out of combat or in brush. <br><passive>6 Trophies:</passive> Increases the range of Rengar\'s Leap by 125.<br><passive>12 Trophies:</passive> Thrill of the Hunt\'s duration is increased by 5 seconds.<br><passive>20 Trophies:</passive> Thrill of the Hunt\'s Movement Speed while stealthed is doubled.', 'Grants bonus health to nearby Siege Weapons'),
	(2074, 3410, 'Head of Kha\'Zix', '<unique>UNIQUE Active - Sweeping Lens:</unique> Reveals and disables nearby invisible traps and invisible wards for 6 seconds in a medium radius and grants detection of invisible units for 10 seconds (60 second cooldown).<br><br><unique>UNIQUE Passive - Mementos of the Hunt:</unique> Rengar collects trophies when killing Champions and gains bonus effects based on how many trophies he has. Kills and assists grant 1 trophy.<br><br><passive>3 Trophies:</passive> Rengar gains 25 Movement Speed whilst out of combat or in brush. <br><passive>6 Trophies:</passive> Increases the range of Rengar\'s Leap by 125.<br><passive>12 Trophies:</passive> Thrill of the Hunt\'s duration is increased by 5 seconds.<br><passive>20 Trophies:</passive> Thrill of the Hunt\'s Movement Speed while stealthed is doubled.', 'Grants bonus health to nearby Siege Weapons'),
	(2075, 3671, 'Enchantment: Warrior', '<stats>+60 Attack Damage<br>+10% Cooldown Reduction</stats>', 'Grants bonus health to nearby Siege Weapons'),
	(2076, 3672, 'Enchantment: Cinderhulk', '<stats>+400 Health<br>+15% Bonus Health</stats><br><br><unique>UNIQUE Passive - Immolate:</unique> Deals 7 (+2 per champion level) magic damage a second to nearby enemies while in combat. Deals 100% bonus damage to monsters. ', 'Grants bonus health to nearby Siege Weapons'),
	(2077, 3673, 'Enchantment: Runic Echoes', '<stats>+60 Ability Power<br>+7% Movement Speed</stats><br><br><unique>UNIQUE Passive - Echo:</unique> Gain charges upon moving or casting. At 100 charges, the next damaging spell hit expends all charges to deal 60 (+10% of Ability Power) bonus magic damage to up to 4 targets on hit.<br><br>This effect deals 250% damage to Large Monsters. Hitting a Large Monster with this effect will restore 18% of your missing Mana.', 'Grants bonus health to nearby Siege Weapons'),
	(2078, 1011, 'Giant\'s Belt', '<stats>+380 Health</stats>', 'Greatly increases Health'),
	(2079, 1006, 'Rejuvenation Bead', '<stats>+50% Base Health Regen </stats>', 'Slightly increases Health Regen'),
	(2080, 1004, 'Faerie Charm', '<stats><mana>+25% Base Mana Regen </mana></stats>', 'Slightly increases Mana Regen'),
	(2081, 3303, 'Spellthief\'s Edge', '<stats>+5 Ability Power<br>+2 Gold per 10 seconds<br><mana>+25% Base Mana Regen </mana></stats><br><br><unique>UNIQUE Passive - Tribute:</unique> Spells and basic attacks against champions or buildings deal 10 additional damage and grant 8 Gold. This can occur up to 3 times every 30 seconds. Killing a minion disables this passive for 12 seconds.<br><br><groupLimit>Limited to 1 Gold Income Item.</groupLimit>', 'Grants gold when you attack enemies'),
	(2082, 3302, 'Relic Shield', '<stats>+75 Health<br>+2 Gold per 10 seconds </stats><br><br><unique>UNIQUE Passive - Spoils of War:</unique> Melee basic attacks execute minions below 195 (+5 per level) Health. Killing a minion heals the owner and the nearest allied champion for 15 Health and grants them kill Gold.<br><br>These effects require a nearby ally. Recharges every 40 seconds. Max 2 charges. <br><br><groupLimit>Limited to 1 Gold Income Item.</groupLimit>', 'Kill minions periodically to heal and grant gold to a nearby ally'),
	(2083, 3301, 'Ancient Coin', '<stats><mana>+25% Base Mana Regen </mana><br>+5% Cooldown Reduction</stats><br><br><unique>UNIQUE Passive - Favor:</unique> Being near a minion\'s death without dealing the killing blow grants 4 Gold and 5 Health.<br><br><groupLimit>Limited to 1 Gold Income Item.</groupLimit><br><br><i><font color=\'#447777\'>\'\'Gold dust rises from the desert and clings to the coin.\'\' - Historian Shurelya, 11 November, 23 CLE</font></i>', 'Grants gold when nearby minions die that you didn\'t kill'),
	(2084, 3422, 'Head of Kha\'Zix', '<unique>UNIQUE Passive - Mementos of the Hunt:</unique> Rengar collects trophies when killing Champions and gains bonus effects based on how many trophies he has. Kills and assists grant 1 trophy.<br><br><passive>3 Trophies:</passive> Rengar gains 25 Movement Speed whilst out of combat or in brush. <br><passive>6 Trophies:</passive> Increases the range of Rengar\'s Leap by 125.<br><passive>12 Trophies:</passive> Thrill of the Hunt\'s duration is increased by 5 seconds.<br><passive>20 Trophies:</passive> Thrill of the Hunt\'s Movement Speed while stealthed is doubled.', 'Grants gold when nearby minions die that you didn\'t kill'),
	(2085, 1001, 'Boots of Speed', '<groupLimit>Limited to 1.</groupLimit><br><br><unique>UNIQUE Passive - Enhanced Movement:</unique> +25 Movement Speed', 'Slightly increases Movement Speed'),
	(2086, 3680, 'Frosted Snax', '<active>Active - <a href=\'FeedTheKing\'>Feed The King</a>:</active> The King lobs many projectiles at far-away enemies, each dealing <scaleLevel>213-775</scaleLevel> magic damage to targets in the center of the impact, scaling down to <scaleLevel>85-310</scaleLevel> on the edge. (120s cooldown)', 'King: Fires a barrage of icy artillery'),
	(2087, 3681, 'Super Spicy Snax', '<active>Active - <a href=\'FeedTheKing\'>Feed The King</a>:</active> The King breathes fire for 4 seconds, dealing <scaleLevel>705-1479</scaleLevel> true damage over the duration to enemies caught in the cone. Deals up to 560 true damage to Turrets. (120s cooldown)', 'King: Shoots flames that burn units and Turrets'),
	(2088, 3682, 'Espresso Snax', '<active>Active - <a href=\'FeedTheKing\'>Feed The King</a>:</active> The King leaps into the air and crashes down twice, knocking enemies away and dealing <scaleLevel>40-190</scaleLevel> physical damage. He also gains a decaying shield for <font color=\'#FF3300\'>20% of his maximum health</font>, lasting 4 seconds. (30s cooldown)', 'King: Knocks back and grants a large shield'),
	(2089, 3683, 'Rainbow Snax Party Pack!', '<active>Active - <a href=\'FeedTheKing\'>Feed The King</a>:</active> The King tosses many Snax behind the enemy, attracting Poros which dash back towards him. Enemy champions hit will be knocked forwards and dealt <scaleLevel>230-680</scaleLevel> physical damage. (120s cooldown)', 'King: Poros knock enemies towards him'),
	(2090, 3200, 'Prototype Hex Core', '<stats>+1 Ability Power per level<br>+10 Mana per level</stats><br><br><unique>UNIQUE Passive - Progress:</unique> This item can be upgraded three times to enhance Viktor\'s basic abilities.', 'Increases Ability Power and can be upgraded to improve Viktor\'s abilities'),
	(2091, 1018, 'Cloak of Agility', '<stats>+20% Critical Strike Chance</stats>', 'Increases critical strike chance'),
	(2092, 3675, 'Enchantment: Bloodrazor', '<stats>+50% Attack Speed</stats><br><br><unique>UNIQUE Passive:</unique> Basic attacks deal 4% of the target\'s maximum Health in bonus physical damage (max 75 vs. monsters and minions) on hit.', 'Increases critical strike chance'),
	(2093, 1033, 'Null-Magic Mantle', '<stats>+25 Magic Resist</stats>', 'Slightly increases Magic Resist'),
	(2094, 3211, 'Spectre\'s Cowl', '<stats>+250 Health<br>+30 Magic Resist</stats><br><br><unique>UNIQUE Passive:</unique> Grants 150% Base Health Regen for up to 10 seconds after taking damage from an enemy champion.', 'Improves defense and grants regeneration upon being damaged'),
	(2095, 1031, 'Chain Vest', '<stats>+40 Armor</stats>', 'Greatly increases Armor'),
	(2096, 1029, 'Cloth Armor', '<stats>+15 Armor</stats>', 'Slightly increases Armor'),
	(2097, 1028, 'Ruby Crystal', '<stats>+150 Health</stats>', 'Increases Health'),
	(2098, 1027, 'Sapphire Crystal', '<stats><mana>+250 Mana</mana></stats>', 'Increases Mana'),
	(2099, 1026, 'Blasting Wand', '<stats>+40 Ability Power</stats>', 'Moderately increases Ability Power'),
	(2100, 3101, 'Stinger', '<stats>+35% Attack Speed</stats><br><br><unique>UNIQUE Passive:</unique> +10% Cooldown Reduction', 'Increased Attack Speed and Cooldown Reduction'),
	(2101, 3222, 'Mikael\'s Crucible', '<stats>+40 Magic Resist<br>+10% Cooldown Reduction<br><mana>+100% Base Mana Regen </mana></stats><br><br><unique>UNIQUE Passive:</unique> +20% Heal and Shield Power<br><unique>UNIQUE Passive - Harmony:</unique> Grants bonus % Base Health Regen equal to your bonus % Base Mana Regen.<br><active>UNIQUE Active:</active> Cleanses all stuns, roots, taunts, fears, silences, and slows on an allied champion and grants them slow immunity for 2 seconds (120 second cooldown).<br><br>Successfully cleansing an effect this way grants the ally 40% movement speed for 2 seconds.', 'Activate to heal and remove all disabling effects from an allied champion'),
	(2102, 1043, 'Recurve Bow', '<stats>+25% Attack Speed</stats><br><br><unique>UNIQUE Passive:</unique> Basic attacks deal an additional 15 physical damage on hit.', 'Greatly increases Attack Speed'),
	(2103, 3100, 'Lich Bane', '<stats>+80 Ability Power<br>+7% Movement Speed<br>+10% Cooldown Reduction<br><mana>+250 Mana</mana></stats><br><br><unique>UNIQUE Passive - Spellblade:</unique> After using an ability, the next basic attack deals 75% Base Attack Damage (+50% of Ability Power) bonus magic damage on hit (1.5 second cooldown).', 'Grants a bonus to next attack after spell cast'),
	(2104, 1042, 'Dagger', '<stats>+12% Attack Speed</stats>', 'Slightly increases Attack Speed'),
	(2105, 2010, 'Total Biscuit of Rejuvenation', '<consumable>Click to Consume:</consumable> Restores 15 Health and 15 Mana immediately and then 150 Health over 15 seconds.', 'Slightly increases Attack Speed'),
	(2106, 3341, 'Sweeping Lens (Trinket)', '<groupLimit>Limited to 1 Trinket.</groupLimit><br><br><active>Active:</active> Scans an area for 6 seconds, warning against hidden hostile units and revealing invisible traps and revealing / disabling wards (90 to 60 second cooldown).<br><br>Cast range and sweep radius gradually improve with level.<br><br><rules>(Switching to a <font color=\'#BBFFFF\'>Totem</font>-type trinket will disable <font color=\'#BBFFFF\'>Trinket</font> use for 120 seconds.)</rules>', 'Detects and disables nearby invisible wards and traps'),
	(2107, 3462, 'Seer Stone (Trinket)', '<groupLimit>Limited to 1 Trinket.</groupLimit><br><br><active>Active:</active> Reveals a small area within <font color=\'#FFFFF\'>2500</font> range for 3 seconds. Enemy champions will be revealed for 5 seconds (60 second cooldown)', 'Briefly reveals a nearby targeted area'),
	(2108, 1041, 'Hunter\'s Machete', '<stats>+10% Life Steal vs. Monsters</stats><br><br><unique>UNIQUE Passive - Nail:</unique> Basic attacks deal 25 bonus damage on hit vs. Monsters. Killing monsters grants <font color=\'#99BBBB\'><a href=\'SpecialJungleExperience\'>special bonus experience</a></font>.', 'Provides damage and life steal versus Monsters'),
	(2109, 3340, 'Warding Totem (Trinket)', '<groupLimit>Limited to 1 Trinket.</groupLimit><br><br><active>Active:</active> Consume a charge to place an invisible <font color=\'#BBFFFF\'>Stealth Ward</font> which reveals the surrounding area for <scaleLevel>60 - 120</scaleLevel> seconds. <br><br>Stores one charge every <scaleLevel>180 - 90</scaleLevel> seconds, up to 2 maximum charges.<br><br>Ward duration and recharge time gradually improve with level.<br><br><rules>(Limit 3 <font color=\'#BBFFFF\'>Stealth Wards</font> on the map per player. Switching to a <font color=\'#BBFFFF\'>Lens</font> type trinket will disable <font color=\'#BBFFFF\'>Trinket</font> use for 120 seconds.)</rules>', 'Periodically place a Stealth Ward'),
	(2110, 3461, 'Golden Transcendence (Disabled)', '<unique>Active:</unique> Use this trinket to teleport to one of the battle platforms. Can only be used from the summoning platform.<br><br><i><font color=\'#FDD017\'>\'\'It is at this magical precipice where a champion is dismantled, reforged, and empowered.\'\'</font></i>', 'Periodically place a Stealth Ward'),
	(2111, 3460, 'Golden Transcendence', '<unique>Active:</unique> Use this trinket to teleport to one of the battle platforms. Can only be used from the summoning platform.<br><br><i><font color=\'#FDD017\'>\'\'It is at this magical precipice where a champion is dismantled, reforged, and empowered.\'\'</font></i>', 'Periodically place a Stealth Ward'),
	(2112, 2009, 'Total Biscuit of Rejuvenation', '<consumable>Click to Consume:</consumable> Restores 80 Health and 50 Mana over 10 seconds.', 'Periodically place a Stealth Ward'),
	(2113, 1039, 'Hunter\'s Talisman', '<stats><mana>+150% Base Mana Regen while in Jungle  </mana></stats><br><br><unique>UNIQUE Passive - Tooth:</unique> Damaging a monster with a spell or attack  steals 25 Health over 5 seconds. Killing monsters grants <font color=\'#99BBBB\'><a href=\'SpecialJungleExperience\'>special bonus experience</a></font>.', 'Provides damage against Monsters and Mana Regen in the Jungle'),
	(2114, 1038, 'B. F. Sword', '<stats>+40 Attack Damage</stats>', 'Greatly increases Attack Damage'),
	(2115, 1037, 'Pickaxe', '<stats>+25 Attack Damage</stats>', 'Moderately increases Attack Damage'),
	(2116, 1036, 'Long Sword', '<stats>+10 Attack Damage</stats>', 'Slightly increases Attack Damage'),
	(2117, 2003, 'Health Potion', '<groupLimit>Limited to 5 at one time. Limited to 1 type of Healing Potion.</groupLimit><br><br><consumable>Click to Consume:</consumable> Restores 150 Health over 15 seconds.', 'Consume to restore Health over time'),
	(2118, 3455, 'Head of Kha\'Zix', '<unique>UNIQUE Passive - Mementos of the Hunt:</unique> Rengar collects trophies when killing Champions and gains bonus effects based on how many trophies he has. Kills and assists grant 1 trophy.<br><br><passive>3 Trophies:</passive> Rengar gains 25 Movement Speed whilst out of combat or in brush. <br><passive>6 Trophies:</passive> Increases the range of Rengar\'s Leap by 125.<br><passive>12 Trophies:</passive> Thrill of the Hunt\'s duration is increased by 5 seconds.<br><passive>20 Trophies:</passive> Thrill of the Hunt\'s Movement Speed while stealthed is doubled.', 'Consume to restore Health over time'),
	(2119, 1055, 'Doran\'s Blade', '<stats>+8 Attack Damage<br>+80 Health<br>+3% Life Steal</stats>', 'Good starting item for attackers'),
	(2120, 3112, 'Guardian\'s Orb', '<stats>+150 Health<br>+30 Ability Power<br><mana>+10 Mana regen per 5 seconds</mana></stats><br><br><groupLimit>Limited to 1 Guardian\'s Item.</groupLimit>', 'Good starting item for mages'),
	(2121, 1054, 'Doran\'s Shield', '<stats>+80 Health</stats><br><br><passive>Passive: </passive>Restores 6 Health every 5 seconds.<br><unique>UNIQUE Passive:</unique> Blocks 8 damage from single target attacks and spells from champions.', 'Good defensive starting item'),
	(2122, 3111, 'Mercury\'s Treads', '<stats>+25 Magic Resist</stats><br><br><unique>UNIQUE Passive - Enhanced Movement:</unique> +45 Movement Speed<br><unique>UNIQUE Passive - Tenacity:</unique> Reduces the duration of stuns, slows, taunts, fears, silences, blinds, polymorphs, and immobilizes by 30%.', 'Increases Movement Speed and reduces duration of disabling effects'),
	(2123, 1053, 'Vampiric Scepter', '<stats>+15 Attack Damage<br>+10% Life Steal</stats>', 'Basic attacks restore Health'),
	(2124, 3110, 'Frozen Heart', '<stats>+90 Armor<br>+20% Cooldown Reduction<br><mana>+400 Mana</mana></stats><br><br><aura>UNIQUE Aura:</aura> Reduces the Attack Speed of nearby enemies by 15%.', 'Massively increases Armor and slows enemy basic attacks'),
	(2125, 1052, 'Amplifying Tome', '<stats>+20 Ability Power</stats>', 'Slightly increases Ability Power'),
	(2126, 1051, 'Brawler\'s Gloves', '<stats>+10% Critical Strike Chance</stats>', 'Slightly increases Critical Strike Chance'),
	(2127, 2140, 'Elixir of Wrath', '<stats><levelLimit>Level 9 required to purchase.</levelLimit></stats><br><br><consumable>Click to Consume:</consumable> Grants +30 Attack Damage and <font color=\'#FF8811\'><u>Bloodlust</u></font> for 3 minutes.<br><br><font color=\'#FF8811\'><u>Bloodlust:</u></font> Dealing physical damage to champions heals for 15% of the damage dealt.<br><br><rules>(Only one Elixir effect may be active at a time.)</rules>', 'Temporarily grants Attack Damage and heals you when dealing physical damage to champions.'),
	(2128, 3109, 'Knight\'s Vow', '<stats>+400 Health<br>+100% Base Health Regen <br>+40 Armor</stats><br><br><active>UNIQUE Active:</active> Designate an allied champion as your <a href=\'KnightsVowPartner\'>Partner</a> (90 second cooldown).<br><passive>UNIQUE Passive:</passive> If your <a href=\'KnightsVowPartner\'>Partner</a> is nearby, gain +20 additional Armor and +15% Movement Speed towards them.<br><passive>UNIQUE Passive:</passive> If your <a href=\'KnightsVowPartner\'>Partner</a> is nearby, heal for 12% of the damage your <a href=\'KnightsVowPartner\'>Partner</a> deals to champions and redirect 12% of the damage your <a href=\'KnightsVowPartner\'>Partner</a> takes from champions to you as <font color=\'#FFFFFF\'>true</font> damage (healing and damage redirection are reduced by 50% if you are ranged).<br><br><rules>(Champions can only be linked by one Knight\'s Vow at a time.)</rules>', 'Partner with an ally to protect each other'),
	(2129, 3902, 'Death\'s Daughter', 'Requires 500 Silver Serpents.<br><br><unique>UNIQUE Passive:</unique> Cannon Barrage additionally fires a mega-cannonball at center of the Barrage, dealing 300% true damage and slowing them by 60% for 1.5 seconds. ', 'Cannon Barrage fires a mega-cannonball'),
	(2130, 3108, 'Fiendish Codex', '<stats>+30 Ability Power</stats><br><br><unique>UNIQUE Passive:</unique> +10% Cooldown Reduction', 'Increases Ability Power and Cooldown Reduction'),
	(2131, 3903, 'Raise Morale', 'Requires 500 Silver Serpents.<br><br><unique>UNIQUE Passive:</unique> Allies in the Cannon Barrage gain 30% Movement Speed for 2 seconds.', 'Cannon Barrage hastes allies'),
	(2132, 2139, 'Elixir of Sorcery', '<stats><levelLimit>Level 9 required to purchase.</levelLimit></stats><br><br><consumable>Click to Consume:</consumable> Grants +50 Ability Power, 15 bonus Mana Regen per 5 seconds and <font color=\'#FF8811\'><u>Sorcery</u></font> for 3 minutes. <br><br><font color=\'#FF8811\'><u>Sorcery:</u></font> Damaging a champion or turret deals 25 bonus True Damage. This effect has a 5 second cooldown versus champions but no cooldown versus turrets.<br><br><rules>(Only one Elixir effect may be active at a time.)</rules><br>', 'Temporarily grants Ability Power and Bonus Damage to champions and turrets.'),
	(2133, 3107, 'Redemption', '<stats>+300 Health<br>+75% Base Health Regen <br>+125% Base Mana Regen <br>+10% Cooldown Reduction</stats><br><br><passive>UNIQUE Passive:</passive> +10% Heal and Shield Power<br><active>UNIQUE Active:</active> Target an area within 5500 range. After 2.5 seconds, call down a beam of light to heal allies for 40 (+25 per level of target) Health, burn enemy champions for 10% of their maximum Health as <font color=\'#FFFFFF\'>true</font> damage and deal 250 <font color=\'#FFFFFF\'>true</font> damage to enemy minions (120 second cooldown).<br><br>Can be used while dead.<br><br><rules>(Half effect if the target has been affected by another Redemption recently.)</rules>', 'Further improves defenses for nearby allies'),
	(2134, 2138, 'Elixir of Iron', '<stats><levelLimit>Level 9 required to purchase.</levelLimit></stats><br><br><consumable>Click to Consume:</consumable> Grants +300 Health, 25% Tenacity, increased champion size, and <font color=\'#FF8811\'><u>Path of Iron</u></font> for 3 minutes.<br><br><font color=\'#FF8811\'><u>Path of Iron:</u></font> Moving leaves a path behind that boosts allied champion\'s Movement Speed by 15%.<br><br><rules>(Only one Elixir effect may be active at a time.)</rules>', 'Temporarily increases defenses. Leaves a trail for allies to follow.'),
	(2135, 3348, 'Arcane Sweeper', '<active>UNIQUE Active - Hunter\'s Sight:</active> An arcane mist grants vision in the target area for 5 seconds, revealing enemy champions and granting <font color=\'#ee91d7\'>True Sight</font> of traps in the area for 3 seconds (90 second cooldown).', 'Activate to reveal a nearby area of the map'),
	(2136, 3105, 'Aegis of the Legion', '<stats>+30 Armor<br>+30 Magic Resist</stats>', 'Grants Armor and Magic Resistance'),
	(2137, 2015, 'Kircheis Shard', '<stats>+15% Attack Speed</stats><br><br><passive>Passive:</passive> Moving and attacking will make an attack <a href=\'Energized\'>Energized</a>.<br><br><unique>UNIQUE Passive - Energized Strike:</unique> Your Energized attacks deal 40 bonus magic damage on hit.', 'Attack speed and a chargable magic hit'),
	(2138, 3104, 'Lord Van Damm\'s Pillager', '<stats>+300 Health<br>+50 Attack Damage<br>+10% Cooldown Reduction</stats><br><br><unique>UNIQUE Passive - Ashes to Ashes:</unique> Controlling the nearest Altar sets you aflame, dealing 25 (+1 per champion level) magic damage per second to nearby enemies (Deals 50% bonus damage to minions and monsters). Controlling the furthest Altar causes your basic attacks to burn targets for up to 114 true damage (based on champion level) over 3 seconds.', 'Reduces Armor of nearby enemies'),
	(2139, 3345, 'Soul Anchor (Trinket)', '<groupLimit>Limited to 1 Trinket.</groupLimit><br><br><active>Active:</active> Consumes a charge to instantly revive at your Summoner Platform and grants 125% Movement Speed that decays over 12 seconds.<br><br><rules>Additional charges are gained at levels 9 and 14.</rules><br><br><font color=\'#BBFFFF\'>(Max: 2 charges)</font></rules><br><br>', 'Consumes charge to revive champion.'),
	(2140, 3102, 'Banshee\'s Veil', '<stats>+300 Health<br>+70 Magic Resist<br>+100% Base Health Regeneration </stats><br><br><unique>UNIQUE Passive:</unique> Grants a spell shield that blocks the next enemy ability. This shield refreshes after no damage is taken from enemy champions for 40 seconds.', 'Periodically blocks enemy abilities'),
	(2141, 3901, 'Fire at Will', 'Requires 500 Silver Serpents.<br><br><unique>UNIQUE Passive:</unique> Cannon Barrage fires at an increasing rate over time (additional 6 waves over the duration).', 'Cannon Barrage gains extra waves'),
	(2142, 3123, 'Executioner\'s Calling', '<stats>+15 Attack Damage</stats><br><br><unique>UNIQUE Passive - Executioner:</unique> Physical damage inflicts <a href=\'GrievousWounds\'>Grievous Wounds</a> on enemy champions for 3 seconds.', 'Overcomes enemies with high health gain'),
	(2143, 2033, 'Corrupting Potion', '<groupLimit>Limited to 1 type of Healing Potion.</groupLimit><br><br><active>UNIQUE Active:</active> Consumes a charge to restore 125 Health and 75 Mana over 12 seconds and grants <font color=\'#FF8811\'><u>Touch of Corruption</u></font> during that time. Holds up to 3 charges that refills upon visiting the shop.<br><br><font color=\'#FF8811\'><u>Touch of Corruption:</u></font> Damaging spells and attacks burn enemy champions for <scaleLevel>15 - 30</scaleLevel> magic damage over 3 seconds. (Half Damage for Area of Effect or Damage over Time spells. Damage increases with champion level.)<br><br><rules>(Corrupting Potion can be used even at full Health and Mana.)</rules>', 'Restores Health and Mana over time and boosts combat power - Refills at Shop'),
	(2144, 3001, 'Abyssal Scepter', '<stats>+60 Ability Power<br>+60 Magic Resist<br>+10% Cooldown Reduction</stats><br><br><aura>UNIQUE Aura:</aura> Nearby enemy champions take 10% more magic damage.', 'Nearby enemies take more magic damage'),
	(2145, 3122, 'Wicked Hatchet', '<stats>+20 Attack Damage<br>+10% Critical Strike Chance</stats><br><br><unique>UNIQUE Passive:</unique> Critical Strikes cause your target to bleed for an additional 60% of your bonus Attack Damage as magic damage over 3 seconds.', 'Critical Strikes cause your target to bleed'),
	(2146, 3364, 'Oracle Alteration', '<levelLimit>* Level 9+ required to upgrade.</levelLimit><stats></stats><br><br>Alters the <font color=\'#FFFFFF\'>Sweeping Lens</font> Trinket:<br><br><stats><font color=\'#00FF00\'>+</font> Increased detection radius<br><font color=\'#00FF00\'>+</font> Sweeping effect follows you for 10 seconds<br><font color=\'#FF0000\'>-</font> <font color=\'#FF6600\'>Cast range reduced to zero</font></stats>', 'Disables nearby invisible wards and traps for a duration'),
	(2147, 2032, 'Hunter\'s Potion', '<groupLimit>Limited to 1 type of Healing Potion.</groupLimit><br><br><active>UNIQUE Active:</active> Consumes a charge to restore 60 Health and 35 Mana over 8 seconds. Holds up to 5 charges and refills upon visiting the shop.<br><br>Killing a Large Monster grants 1 charge.<br><br><rules>(Killing a Large Monster at full charges will automatically consume the newest charge.)</rules>', 'Restores Health and Mana over time - Refills at shop and has increased capacity'),
	(2148, 3363, 'Farsight Alteration', '<levelLimit>* Level 9+ required to upgrade.</levelLimit><br><br>Alters the <font color=\'#FFFFFF\'>Warding Totem</font> Trinket:<br><br><stats><font color=\'#00FF00\'>+</font> Massively increased cast range (+650%)<br><font color=\'#00FF00\'>+</font> Infinite duration and does not count towards ward limit<br><font color=\'#FF0000\'>-</font> <font color=\'#FF6600\'>10% increased cooldown</font><br><font color=\'#FF0000\'>-</font> <font color=\'#FF6600\'>Ward is visible, fragile, untargetable by allies</font><br><font color=\'#FF0000\'>-</font> <font color=\'#FF6600\'>45% reduced ward vision radius</font><br><font color=\'#FF0000\'>-</font> <font color=\'#FF6600\'>Cannot store charges</font></stats>', 'Grants increased range and reveals the targetted area'),
	(2149, 2031, 'Refillable Potion', '<groupLimit>Limited to 1 type of Healing Potion.</groupLimit><br><br><active>UNIQUE Active:</active> Consumes a charge to restore 125 Health over 12 seconds. Holds up to 2 charges and refills upon visiting the shop.', 'Restores Health over time. Refills at shop.'),
	(2150, 3362, 'Greater Vision Totem (Trinket)', '<groupLimit>Limited to 1 Trinket.</groupLimit><levelLimit> *Level 9+ required to upgrade.</levelLimit><stats></stats><br><br><unique>UNIQUE Active:</unique> Places a visible ward that reveals the surrounding area and invisible units in the area until killed (120 second cooldown). Limit 1 <font color=\'#BBFFFF\'>Vision Ward</font> on the map per player.<br><br><rules>(Trinkets cannot be used in the first 30 seconds of a game. Selling a Trinket will disable Trinket use for 120 seconds).</rules>', 'Periodically place a Vision Ward'),
	(2151, 3361, 'Greater Stealth Totem (Trinket)', '<groupLimit>Limited to 1 Trinket.</groupLimit><levelLimit> *Level 9+ required to upgrade.</levelLimit><stats></stats><br><br><unique>UNIQUE Active:</unique> Consume a charge to place an invisible ward that reveals the surrounding area for 180 seconds.  Stores a charge every 60 seconds, up to 2 total. Limit 3 <font color=\'#BBFFFF\'>Stealth Wards</font> on the map per player.<br><br><rules>(Trinkets cannot be used in the first 30 seconds of a game. Selling a Trinket will disable Trinket use for 120 seconds).</rules>', 'Periodically place a Stealth Ward'),
	(2152, 3117, 'Boots of Mobility', '<unique>UNIQUE Passive - Enhanced Movement:</unique> +25 Movement Speed. Increases to +115 Movement Speed when out of combat for 5 seconds.', 'Greatly enhances Movement Speed when out of combat'),
	(2153, 3116, 'Rylai\'s Crystal Scepter', '<stats>+300 Health<br>+75 Ability Power</stats><br><br><unique>UNIQUE Passive:</unique> Damaging spells and abilities reduce enemy movement speed by 20% for 1 second.', 'Abilities slow enemies'),
	(2154, 1058, 'Needlessly Large Rod', '<stats>+60 Ability Power</stats>', 'Greatly increases Ability Power'),
	(2155, 3115, 'Nashor\'s Tooth', '<stats>+50% Attack Speed<br>+80 Ability Power</stats><br><br><unique>UNIQUE Passive:</unique> +20% Cooldown Reduction<br><unique>UNIQUE Passive:</unique> Basic attacks deal 15 (+15% of Ability Power) bonus magic damage on hit.<br>', 'Increases Attack Speed, Ability Power, and Cooldown Reduction'),
	(2156, 3599, 'The Black Spear', '<stats></stats><br><active>Active:</active> Offer to bind with an ally for the remainder of the game, becoming Oathsworn Allies. Oathsworn empowers you both while near one another.', 'Kalista\'s spear that binds an Oathsworn Ally.'),
	(2157, 1057, 'Negatron Cloak', '<stats>+40 Magic Resist</stats>', 'Moderately increases Magic Resist'),
	(2158, 3114, 'Forbidden Idol', '<stats><mana>+50% Base Mana Regen </mana></stats><br><br><unique>UNIQUE Passive:</unique> +10% Cooldown Reduction<br><unique>UNIQUE Passive:</unique> +8% Heal and Shield Power', 'Increases Mana Regeneration and Cooldown Reduction'),
	(2159, 1056, 'Doran\'s Ring', '<stats>+60 Health<br>+15 Ability Power<br><mana>+50% Base Mana Regen </mana></stats><br><br><mana><passive>Passive:</passive> Restores 4 Mana upon killing a unit.</mana>', 'Good starting item for casters'),
	(2160, 3113, 'Aether Wisp', '<stats>+30 Ability Power</stats><br><br><unique>UNIQUE Passive:</unique> +5% Movement Speed', 'Increases Ability Power and Movement Speed'),
	(2161, 2045, 'Ruby Sightstone', '<stats>+500 Health</stats><br><br><unique>UNIQUE Passive:</unique> Item Active cooldowns are reduced by 20%.<br><active>UNIQUE Active - Warding:</active> Consumes a charge to place a <font color=\'#BBFFFF\'>Stealth Ward</font> that reveals the surrounding area for 150 seconds. Holds up to 4 charges and refills when visiting the shop.<br><br><rules>(A player may only have 3 <font color=\'#BBFFFF\'>Stealth Wards</font> on the map at one time. Unique Passives with the same name don\'t stack.)</rules>', 'Greatly increases Health and provides Stealth Wards over time'),
	(2162, 3134, 'Serrated Dirk', '<stats>+25 Attack Damage</stats><br><br><unique>UNIQUE Passive:</unique> +10 <a href=\'Lethality\'>Lethality</a><br><unique>UNIQUE Passive:</unique> +20 Movement Speed out of Combat.', 'Increases Attack Damage and Lethality'),
	(2163, 3133, 'Caulfield\'s Warhammer', '<stats>+25 Attack Damage</stats><br><br><unique>UNIQUE Passive:</unique> +10% Cooldown Reduction', 'Attack Damage and Cooldown Reduction'),
	(2164, 3010, 'Catalyst of Aeons', '<stats>+225 Health<br><mana>+300 Mana</mana></stats><br><br><unique>UNIQUE Passive - Eternity:</unique> 15% of damage taken from champions is gained as Mana. <br><br>Spending Mana restores 20% of the cost as Health, up to 15 per spell cast.  <br><br><rules>(Toggled Spells heal for a maximum of 15 per second.)</rules>', 'Spend Mana to recover Health'),
	(2165, 3252, 'Poacher\'s Dirk', '<stats>+15 Attack Damage</stats><br><br><unique>UNIQUE Passive:</unique> +20 Movement Speed out of Combat<br><unique>UNIQUE Passive:</unique> After poaching 3 large monsters from the enemy jungle (60 second cooldown), transforms into a Serrated Dirk.', 'Transforms into a Serrated Dirk after poaching in the enemy jungle.'),
	(2166, 3009, 'Boots of Swiftness', '<unique>UNIQUE Passive - Enhanced Movement:</unique> +55 Movement Speed<br><unique>UNIQUE Passive - Slow Resist:</unique> Movement slowing effects are reduced by 25%.', 'Enhances Movement Speed and reduces the effect of slows'),
	(2167, 3008, 'Manamune (Quick Charge)', '<stats>+25 Attack Damage<br><mana>+250 Mana</mana></stats><br><br><mana><unique>UNIQUE Passive - Awe:</unique> Grants bonus Attack Damage equal to 2% of maximum Mana. Refunds 15% of Mana spent.<br><unique>UNIQUE Passive - Mana Charge:</unique> Grants +6 maximum Mana (max +750 Mana) for each basic attack, spell cast or Mana expenditure (occurs up to 2 times every 8 seconds).<br><br>Transforms into Muramana at +750 Mana.</mana>', 'Increases Attack Damage based on maximum Mana'),
	(2168, 3007, 'Archangel\'s Staff (Quick Charge)', '<stats>+80 Ability Power<br><mana>+250 Mana</mana></stats><br><br><mana><unique>UNIQUE Passive - Awe:</unique> Grants Ability Power equal to 3% of maximum Mana. Refunds 25% of Mana spent. <br><unique>UNIQUE Passive - Mana Charge:</unique> Grants +12 maximum Mana (max +750 Mana) for each spell cast or Mana expenditure (occurs up to 2 times every 8 seconds).<br><br>Transforms into Seraph\'s Embrace at +750 Mana.</mana>', 'Increases Ability Power based on maximum Mana'),
	(2169, 3006, 'Berserker\'s Greaves', '<stats> +35% Attack Speed</stats><br><br><unique>UNIQUE Passive - Enhanced Movement:</unique> +45 Movement Speed', 'Enhances Movement Speed and Attack Speed'),
	(2170, 3004, 'Manamune', '<stats>+25 Attack Damage<br><mana>+250 Mana</mana></stats><br><br><mana><unique>UNIQUE Passive - Awe:</unique> Grants bonus Attack Damage equal to 2% of maximum Mana. Refunds 15% of Mana spent.<br><unique>UNIQUE Passive - Mana Charge:</unique> Grants +4 maximum Mana (max +750 Mana) for each basic attack, spell cast or Mana expenditure (occurs up to 2 times every 8 seconds).<br><br>Transforms into Muramana at +750 Mana.</mana>', 'Increases Attack Damage based on maximum Mana'),
	(2171, 3003, 'Archangel\'s Staff', '<stats>+80 Ability Power<br><mana>+250 Mana</mana></stats><br><br><mana><unique>UNIQUE Passive - Awe:</unique> Grants Ability Power equal to 3% of maximum Mana. Refunds 25% of Mana spent.<br><unique>UNIQUE Passive - Mana Charge:</unique> Grants +8 maximum Mana (max +750 Mana) for each spell cast or Mana expenditure (occurs up to 2 times every 8 seconds).<br><br>Transforms into Seraph\'s Embrace at +750 Mana.</mana>', 'Increases Ability Power based on maximum Mana'),
	(2172, 3124, 'Guinsoo\'s Rageblade', '<stats>+35 Attack Damage<br>+50 Ability Power<br>+25% Attack Speed</stats><br><br><passive>Passive: </passive>Basic attacks deal an additional 15 magic damage on hit.<br><unique>UNIQUE Passive:</unique> Basic attacks grant +8% Attack Speed, +3 Attack Damage, and +4 Ability Power for 5 seconds (stacks up to 6 times). While you have 6 stacks, gain <unlockedPassive>Guinsoo\'s Rage</unlockedPassive>.<br><br><unlockedPassive>Guinsoo\'s Rage:</unlockedPassive> Every other basic attack will trigger on hit effects an additional time.', 'Increases Ability Power and Attack Damage'),
	(2173, 3800, 'Righteous Glory', '<stats>+500 Health<br><mana>+300 Mana</mana><br>+100% Base Health Regen </stats><br><br><unique>UNIQUE Passive - Eternity:</unique> 15% of damage taken from champions is gained as Mana. Spending Mana restores 20% of the cost as Health, up to 25 per spell cast.  <br><unique>UNIQUE Active:</unique> Grants +75% Movement Speed when moving towards enemies or enemy turrets for 4 seconds. After 3 seconds, a shockwave is emitted, slowing nearby enemy champion Movement Speed by 75% for 2 second(s) (90 second cooldown).<br><br>This effect may be reactivated early to instantly release the shockwave.', 'Grants Health, Mana. Activate to speed towards enemies and slow them.'),
	(2174, 3801, 'Crystalline Bracer', '<stats>+200 Health<br>+50% Base Health Regen </stats>', 'Grants Health and Health Regen'),
	(2175, 3802, 'Lost Chapter', '<stats>+25 Ability Power<br><mana>+300 Mana</mana></stats><br><br><unique>UNIQUE Passive:</unique> Upon levelling up, restores 20% of your maximum Mana over 3 seconds.', 'Restores Mana upon levelling up.'),
	(2176, 3024, 'Glacial Shroud', '<stats>+25 Armor<br><mana>+250 Mana</mana></stats><br><br><unique>UNIQUE Passive:</unique> +10% Cooldown Reduction', 'Increases Armor and Cooldown Reduction'),
	(2177, 3145, 'Hextech Revolver', '<stats>+40 Ability Power</stats><br><br><unique>UNIQUE Passive - Magic Bolt:</unique> Damaging an enemy champion with a basic attack shocks them for <scaleLevel>50 - 125</scaleLevel> bonus magic damage (40 second cooldown, shared with other <font color=\'#9999FF\'><a href=\'itembolt\'>Hextech</a></font> items).<br><br>Magic Bolt\'s cooldown is reduced by Active Item cooldown reduction.<br><br><rules>(Damage scales based on level. Hextech effects can trigger other item spell effects.)</rules>', 'Increases Ability Power. Deal bonus magic damage on attack periodically.'),
	(2178, 2055, 'Control Ward', '<groupLimit>Can only carry 3 Control Wards in inventory.</groupLimit><br><br><consumable>Click to Consume:</consumable> Places a ward that grants vision of the surrounding area. This device will also reveal invisible traps and reveal / disable wards. Control Wards do not disable other Control Wards. Camouflaged units will also be revealed. <br><br>Limit 1 <font color=\'#BBFFFF\'>Control Ward</font> on the map per player.', 'Used to disable wards and invisible traps in an area.'),
	(2179, 3144, 'Bilgewater Cutlass', '<stats>+25 Attack Damage<br>+10% Life Steal</stats><br><br><active>UNIQUE Active:</active> Deals 100 magic damage and slows the target champion\'s Movement Speed by 25% for 2 seconds (90 second cooldown).', 'Activate to deal magic damage and slow target champion'),
	(2180, 2054, 'Diet Poro-Snax', 'All the flavor of regular Poro-Snax, without the calories! Keeps your Poro happy AND healthy.<br><br><consumable>Click to Consume:</consumable> Gives your Poros a delicious healthy treat.', 'Activate to deal magic damage and slow target champion'),
	(2181, 3022, 'Frozen Mallet', '<stats>+700 Health<br>+30 Attack Damage</stats><br><br><unique>UNIQUE Passive - Icy:</unique> Basic attacks slow the target\'s Movement Speed for 1.5 seconds on hit (40% slow for melee attacks, 30% slow for ranged attacks).', 'Basic attacks slow enemies'),
	(2182, 3143, 'Randuin\'s Omen', '<stats>+500 Health<br>+60 Armor<br>-10% Damage taken from Critical Strikes</stats><br><br><unique>UNIQUE Passive - Cold Steel:</unique> When hit by basic attacks, reduces the attacker\'s Attack Speed by 15% (1 second duration).<br><active>UNIQUE Active:</active> Slows the Movement Speed of nearby enemy units by 35% for 4 seconds (60 second cooldown).', 'Greatly increases defenses, activate to slow nearby enemies'),
	(2183, 2053, 'Raptor Cloak', '<stats>+40 Armor<br>+125% Base Health Regen </stats><br><br><unique>UNIQUE Passive - Point Runner:</unique> Builds up to +20% Movement Speed over 2 seconds while near turrets, fallen turrets and Void Gates.', 'Enhances Movement Speed near turrets'),
	(2184, 3142, 'Youmuu\'s Ghostblade', '<stats>+60 Attack Damage<br>+10% Cooldown Reduction</stats><br><br><unique>UNIQUE Passive:</unique> +15 <a href=\'Lethality\'>Lethality</a><br><unique>UNIQUE Passive:</unique> +20 Movement Speed out of Combat<br><active>UNIQUE Active:</active> Grants +20% Movement Speed for 6 seconds (45 second cooldown).', 'Activate to greatly increase Movement Speed'),
	(2185, 2052, 'Poro-Snax', 'This savory blend of free-range, grass-fed Avarosan game hens and organic, non-ZMO Freljordian herbs contains the essential nutrients necessary to keep your Poro purring with pleasure.<br><br><i>All proceeds will be donated towards fighting Noxian animal cruelty.</i>', 'Activate to greatly increase Movement Speed'),
	(2186, 3020, 'Sorcerer\'s Shoes', '<stats>+15 <a href=\'FlatMagicPen\'>Magic Penetration</a></stats><br><br><unique>UNIQUE Passive - Enhanced Movement:</unique> +45 Movement Speed', 'Enhances Movement Speed and magic damage'),
	(2187, 1083, 'Cull', '<stats>+7 Attack Damage<br>+3 Life on Hit</stats><br><br><unique>UNIQUE Passive:</unique> Killing a lane minion grants 1 additional Gold. Killing 100 lane minions grants an additional 350 bonus gold immediately and disables this passive.', 'Provides damage and Life Steal on hit - Killing minions grant bonus Gold'),
	(2188, 2051, 'Guardian\'s Horn', '<stats>+150 Health</stats><br><br><passive>Passive: </passive>Restores 20 Health every 5 seconds.<br><unique>UNIQUE Passive:</unique> Blocks 12 damage from attacks and spells from champions (25% effectiveness vs. damage over time abilities).<br><br><groupLimit>Limited to 1 Guardian\'s Item.</groupLimit>', 'Good starting item for tanks'),
	(2189, 3140, 'Quicksilver Sash', '<stats>+30 Magic Resist</stats><br><br><active>UNIQUE Active - Quicksilver:</active> Removes all crowd control debuffs (90 second cooldown).', 'Activate to remove all crowd control debuffs'),
	(2190, 1082, 'The Dark Seal', '<stats>+15 Ability Power<br>+25% Increased Healing from Potions<br><mana>+100 Mana</mana></stats><br><br><unique>UNIQUE Passive - Dread:</unique> Grants +3 Ability Power per Glory.  <br><unique>UNIQUE Passive - Do or Die:</unique> Grants 2 Glory for a champion kill or 1 Glory for an assist, up to 10 Glory total. Lose 4 Glory on death.', 'Provides Ability Power and Mana.  Increases in power as you kill enemies.'),
	(2191, 2050, 'Explorer\'s Ward', '<consumable>Click to Consume:</consumable> Places an invisible ward that reveals the surrounding area for 60 seconds.', 'Provides Ability Power and Mana.  Increases in power as you kill enemies.'),
	(2192, 3814, 'Edge of Night', '<stats>+55 Attack Damage<br>+35 Magic Resist</stats><br><br><unique>UNIQUE Passive:</unique> +15 <a href=\'Lethality\'>Lethality</a><br><unique>UNIQUE Passive:</unique> +20 Movement Speed out of Combat<br><unique>UNIQUE Active - Night\'s Veil:</unique> Channel for 1.5 second to grant a spell shield that blocks the next enemy ability. Lasts for 5 seconds (45 second cooldown).<br><br><rules>(Can move while channeling, but taking damage breaks the channel.)</rules>', 'Blocks an incoming enemy spell.'),
	(2193, 3139, 'Mercurial Scimitar', '<stats>+65 Attack Damage<br>+35 Magic Resist<br>+10% Life Steal</stats><br><br><active>UNIQUE Active - Quicksilver:</active> Removes all crowd control debuffs and also grants +50% bonus Movement Speed for 1 second (90 second cooldown).', 'Activate to remove all crowd control debuffs and grant massive Movement Speed'),
	(2194, 2049, 'Sightstone', '<stats>+150 Health</stats><br><br><active>UNIQUE Active - Warding:</active> Consumes a charge to place a <font color=\'#BBFFFF\'>Stealth Ward</font> that reveals the surrounding area for 150 seconds.  Holds up to 3 charges which refill upon visiting the shop. <br><br><rules>(A player may only have 3 <font color=\'#BBFFFF\'>Stealth Wards</font> on the map at one time. Unique Passives with the same name don\'t stack.)</rules>', 'Increases Health and provides Stealth Wards over time'),
	(2195, 3137, 'Dervish Blade', '<stats>+50% Attack Speed<br>+45 Magic Resist<br>+10% Cooldown Reduction</stats><br><br><active>UNIQUE Active - Quicksilver:</active> Removes all debuffs, and if the champion is melee, also grants +50% bonus Movement Speed for 1 second (90 second cooldown).', 'Activate to remove all debuffs and grant massive Movement Speed'),
	(2196, 2047, 'Oracle\'s Extract', '<consumable>Click to Consume:</consumable> Grants detection of nearby invisible or unseen enemy units for 5 minutes.', 'Allows champion to see invisible or unseen enemy units'),
	(2197, 3136, 'Haunting Guise', '<stats>+25 Ability Power<br>+200 Health</stats><br><br><unique>UNIQUE Passive - Eyes of Pain:</unique> +15 <a href=\'FlatMagicPen\'>Magic Penetration</a>', 'Increases magic damage'),
	(2198, 3135, 'Void Staff', '<stats>+80 Ability Power</stats><br><br><unique>UNIQUE Passive:</unique> +35% <a href=\'TotalMagicPen\'>Magic Penetration</a>.', 'Increases magic damage'),
	(2199, 3812, 'Death\'s Dance', '<stats>+75 Attack Damage<br>+10% Cooldown Reduction</stats><br><br><unique>UNIQUE Passive:</unique> Dealing physical damage heals for 15% of the damage dealt. This is 33% as effective for Area of Effect damage.<br><unique>UNIQUE Passive:</unique> 15% of damage taken is dealt as a Bleed effect over 3 seconds instead.', 'Trades incoming damage now for incoming damage later'),
	(2200, 3035, 'Last Whisper', '<stats>+10 Attack Damage</stats><br><br><unique>UNIQUE Passive - Last Whisper:</unique> +45% <a href=\'BonusArmorPen\'>Bonus Armor Penetration</a>', 'Overcomes enemies with high Armor'),
	(2201, 3156, 'Maw of Malmortius', '<stats>+50 Attack Damage<br>+45 Magic Resist<br>+10% Cooldown Reduction</stats><br><br><unique>UNIQUE Passive - Lifeline:</unique> Upon taking magic damage that would reduce Health below 30%, grants a shield that absorbs magic damage equal to 300 + 1 per bonus Magic Resistance for 5 seconds (90 second cooldown).<br><unlockedPassive>Lifegrip:</unlockedPassive> When <i>Lifeline</i> triggers, gain +20 Attack Damage, +10% Spell Vamp and +10% Life Steal until out of combat.', 'Grants bonus Attack Damage when Health is low'),
	(2202, 3034, 'Giant Slayer', '<stats>+10 Attack Damage</stats><br><br><unique>UNIQUE Passive - Giant Slayer:</unique> Grants up to +10% physical damage against enemy champions with greater maximum Health than you (+1% damage per 100 Health difference, maxing at 1000 Health difference).<br><br><rules>(Unique Passives with the same name don\'t stack.)</rules>', 'Overcomes enemies with high Health'),
	(2203, 3155, 'Hexdrinker', '<stats>+20 Attack Damage<br>+35 Magic Resist</stats><br><br><unique>UNIQUE Passive - Lifeline:</unique> Upon taking magic damage that would reduce Health below 30%, grants a shield that absorbs 110 to 280 (based on level) magic damage for 5 seconds (90 second cooldown).', 'Increases Attack Damage and Magic Resist'),
	(2204, 3033, 'Mortal Reminder', '<stats>+50 Attack Damage</stats><br><br><unique>UNIQUE Passive - Executioner:</unique> Physical damage inflicts <a href=\'GrievousWounds\'>Grievous Wounds</a> on enemy champions for 5 seconds.<br><unique>UNIQUE Passive - Last Whisper:</unique> +45% <a href=\'BonusArmorPen\'>Bonus Armor Penetration</a>.', 'Overcomes enemies with high Health recovery and Armor'),
	(2205, 3153, 'Blade of the Ruined King', '<stats>+40 Attack Damage<br>+25% Attack Speed<br>+15% Life Steal</stats><br><br><unique>UNIQUE Passive:</unique> Basic attacks deal 8% of the target\'s current Health in bonus physical damage (max 60 vs. monsters and minions) on hit. Life Steal applies to this damage.<br><active>UNIQUE Active:</active> Deals 100 magic damage to target champion and steals 25% of their Movement Speed for 3 seconds (90 second cooldown).', 'Deals damage based on target\'s Health, can steal Movement Speed'),
	(2206, 3031, 'Infinity Edge', '<stats>+70 Attack Damage<br>+20% Critical Strike Chance</stats><br><br><unique>UNIQUE Passive:</unique> Critical strike bonus damage is increased by 50%.', 'Massively enhances critical strikes'),
	(2207, 3152, 'Hextech Protobelt-01', '<stats>+300 Health<br>+60 Ability Power<br>+10% Cooldown Reduction</stats><br><br><unique>UNIQUE Active - Fire Bolt:</unique> Dash forward and unleash a nova of fire bolts that deal <scaleLevel>75 - 150</scaleLevel> (+25% of your Ability Power) as magic damage (40 second cooldown, shared with other <font color=\'#9999FF\'><a href=\'itembolt\'>Hextech</a></font> items).<br><br>Champions and Monsters hit by multiple fire bolts take 10% damage per additional bolt.<br><br><rules>(This dash cannot pass through terrain.)</rules>', 'Activate to dash forward and unleash a fiery explosion'),
	(2208, 3030, 'Hextech GLP-800', '<stats>+300 Health<br><mana>+400 Mana</mana><br>+80 Ability Power</stats><br><br><unique>UNIQUE Passive - Eternity:</unique> 15% of damage taken from champions is gained as Mana. Spending Mana restores 20% of the cost as Health, up to 25 per spell cast.<br><unique>UNIQUE Active - Frost Bolt:</unique> Fires a spray of icy bolts that explode, dealing <scaleLevel>100 - 200</scaleLevel> (+35% of your Ability Power) magic damage to all enemies hit. (40 second cooldown, shared with other <font color=\'#9999FF\'><a href=\'itembolt\'>Hextech</a></font> items).<br><br>Enemies hit are slowed by 65% decaying over 0.5 seconds.<br><br><rules>(Frost Bolt has a cast time, in contrast to most actives.)</rules> ', 'Activate to fire icy bolts to slow enemies'),
	(2209, 3151, 'Liandry\'s Torment', '<stats>+80 Ability Power<br>+300 Health</stats><br><br><unique>UNIQUE Passive - Eyes of Pain:</unique> +15 <a href=\'FlatMagicPen\'>Magic Penetration</a><br><unique>UNIQUE Passive:</unique> Spells burn enemies for 3 seconds, dealing bonus magic damage equal to 2% of their current Health per second. Burn damage is doubled against <a href=\'MovementImpaired\'>movement-impaired</a> units.', 'Spell damage burns enemies for a portion of their Health'),
	(2210, 1402, 'Enchantment: Runic Echoes', '<stats>+60 Ability Power<br>+7% Movement Speed</stats><br><br><unique>UNIQUE Passive - Echo:</unique> Gain charges upon moving or casting. At 100 charges, the next damaging spell hit expends all charges to deal 60 (+10% of Ability Power) bonus magic damage to up to 4 targets on hit.<br><br>This effect deals 250% damage to Large Monsters. Hitting a Large Monster with this effect will restore 18% of your missing Mana.', 'Grants Ability Power and periodically empowers your Spells'),
	(2211, 3706, 'Stalker\'s Blade', '<groupLimit>Limited to 1 Jungle item</groupLimit><br><br><stats>+10% Life Steal vs. Monsters<br><mana>+180% Base Mana Regen while in Jungle</mana></stats><br><br><unique>UNIQUE Passive - Chilling Smite:</unique> Smite can be cast on enemy champions, dealing reduced true damage and stealing 20% Movement Speed for 2 seconds. <br><unique>UNIQUE Passive - Tooth / Nail:</unique> Basic attacks deal 25 bonus damage vs. monsters. Damaging a monster with a spell or attack steals 30 Health over 5 seconds. Killing monsters grants <font color=\'#99BBBB\'><a href=\'SpecialJungleExperience\'>special bonus experience</a></font>.', 'Lets your Smite slow Champions'),
	(2212, 1401, 'Enchantment: Cinderhulk', '<stats>+400 Health<br>+15% Bonus Health</stats><br><br><unique>UNIQUE Passive - Immolate:</unique> Deals 7 (+2 per champion level) magic damage a second to nearby enemies while in combat. Deals 100% bonus damage to monsters. ', 'Grants Health and Immolate Aura'),
	(2213, 3029, 'Rod of Ages (Quick Charge)', '<stats>+300 Health<br><mana>+300 Mana</mana><br>+60 Ability Power</stats><br><br><passive>Passive:</passive> Grants +20 Health, +10 Mana, and +4 Ability Power per stack (max +200 Health, +100 Mana, and +40 Ability Power). Grants 1 stack per 40 seconds (max 10 stacks).<br><unique>UNIQUE Passive - Eternity:</unique> 15% of damage taken from champions is gained as Mana. Spending Mana restores 20% of the cost as Health, up to 25 per spell cast.', 'Greatly increases Health, Mana, and Ability Power'),
	(2214, 1400, 'Enchantment: Warrior', '<stats>+60 Attack Damage<br>+10% Cooldown Reduction</stats>', 'Grants Attack Damage and Cooldown Reduction'),
	(2215, 3028, 'Chalice of Harmony', '<stats>+30 Magic Resist<br><mana>+50% Base Mana Regen </mana></stats><br><br><unique>UNIQUE Passive - Harmony:</unique> Grants bonus % Base Health Regen equal to your bonus % Base Mana Regen.</unique>', 'Increases Mana and Health Regeneration'),
	(2216, 3027, 'Rod of Ages', '<stats>+300 Health<br><mana>+300 Mana</mana><br>+60 Ability Power</stats><br><br><passive>Passive:</passive> Grants +20 Health, +10 Mana, and +4 Ability Power per stack (max +200 Health, +100 Mana, and +40 Ability Power). Grants 1 stack per minute (max 10 stacks).<br><unique>UNIQUE Passive - Eternity:</unique> 15% of damage taken from champions is gained as Mana. Spending Mana restores 20% of the cost as Health, up to 25 per spell cast.', 'Greatly increases Health, Mana, and Ability Power'),
	(2217, 3026, 'Guardian Angel', '<stats>+60 Armor<br>+45 Magic Resist</stats><br><br><unique>UNIQUE Passive:</unique> Upon taking lethal damage, restores the greater of 700 Health or 30% of maximum Health and 30% of maximum Mana after 4 seconds of stasis (300 second cooldown).', 'Periodically revives champion upon death'),
	(2218, 3147, 'Duskblade of Draktharr', '<stats>+65 Attack Damage</stats><br><br><unique>UNIQUE Passive:</unique> +15 <a href=\'Lethality\'>Lethality</a><br><unique>UNIQUE Passive:</unique> +20 Movement Speed out of Combat.<br><unique>UNIQUE Passive - Nightstalker:</unique> After being unseen for at least 1 second, your next Basic Attack against an enemy champion will deal 75 (+200% Lethality) true damage on-hit (lasts for 4 seconds after being seen by an enemy champion).<br><unique>UNIQUE Passive - Blackout:</unique> When spotted by an enemy ward, causes a blackout for 8 seconds, revealing invisible traps and revealing / disabling wards (90 second cooldown).', 'Deals additional true damage on-hit and provides true sight periodically'),
	(2219, 3025, 'Iceborn Gauntlet', '<stats>+65 Armor<br>+20% Cooldown Reduction<br><mana>+500 Mana</mana></stats><br><br><unique>UNIQUE Passive - Spellblade:</unique> After using an ability, the next basic attack deals bonus physical damage equal to 100% of base Attack Damage in an area and creates an icy zone for 2 seconds that slows Movement Speed by 30% (1.5 second cooldown).<br><br>Size of zone increases with bonus armor.', 'Basic attacks create a slow field after spell cast'),
	(2220, 3146, 'Hextech Gunblade', '<stats>+40 Attack Damage<br>+80 Ability Power</stats><br><br><unique>UNIQUE Passive:</unique> Heal for 15% of damage dealt. This is 33% as effective for Area of Effect damage.<br><active>UNIQUE Active - Lightning Bolt:</active> Deals <scaleLevel>175 - 250</scaleLevel> (+30% of Ability Power) magic damage and slows the target champion\'s Movement Speed by 40% for 2 seconds (40 second cooldown, shared with other <font color=\'#9999FF\'><a href=\'itembolt\'>Hextech</a></font> items).', 'Increases Attack Damage and Ability Power, activate to slow a target'),
	(2221, 1409, 'Enchantment: Cinderhulk', '<stats>+400 Health<br>+15% Bonus Health</stats><br><br><unique>UNIQUE Passive - Immolate:</unique> Deals 7 (+2 per champion level) magic damage a second to nearby enemies while in combat. Deals 100% bonus damage to monsters. ', 'Grants Health and Immolate Aura'),
	(2222, 1408, 'Enchantment: Warrior', '<stats>+60 Attack Damage<br>+10% Cooldown Reduction</stats>', 'Grants Attack Damage and Cooldown Reduction'),
	(2223, 3046, 'Phantom Dancer', '<stats>+45% Attack Speed<br>+30% Critical Strike Chance<br>+5% Movement Speed</stats><br><br><unique>UNIQUE Passive - Spectral Waltz:</unique> While within 550 units of an enemy champion you can see, +7% Movement Speed and you can move through units.<br><unique>UNIQUE Passive - Lament:</unique> The last champion hit deals 12% less damage to you (ends after 10 seconds of not hitting).', 'Move faster near enemies and reduce incoming damage'),
	(2224, 3044, 'Phage', '<stats>+200 Health<br>+15 Attack Damage</stats><br><br><unique>UNIQUE Passive - Rage:</unique> Basic attacks grant 20 Movement Speed for 2 seconds. Kills grant 60 Movement Speed instead. This Movement Speed bonus is halved for ranged champions.', 'Attacks and kills give a small burst of speed'),
	(2225, 3165, 'Morellonomicon', '<stats>+100 Ability Power<br><mana>+400 Mana</mana></stats><br><br><unique>UNIQUE Passive:</unique> +20% Cooldown Reduction<br><unique>UNIQUE Passive:</unique> Dealing magic damage to champions below 35% Health inflicts <a href=\'GrievousWounds\'>Grievous Wounds</a> for 8 seconds.<br><unique>UNIQUE Passive:</unique> Kills and Assists restore 20% of your maximum Mana.', 'Greatly increases Ability Power and Cooldown Reduction'),
	(2226, 3043, 'Muramana', '<stats>+25 Attack Damage<br><mana>+1000 Mana</mana></stats><br><br><mana><unique>UNIQUE Passive - Awe:</unique> Grants bonus Attack Damage equal to 2% of maximum Mana. Refunds 15% of Mana spent.</mana><br><mana><unique>UNIQUE Passive - Shock:</unique> Single target spells and attacks (on hit) on <font color=\'#FFFFFF\'>Champions</font> consume 3% of current Mana to deal bonus physical damage equal to twice the amount of Mana consumed.<br><br>This effect only activates while you have greater than 20% maximum Mana.</mana>', 'Greatly increases Ability Power and Cooldown Reduction'),
	(2227, 3285, 'Luden\'s Echo', '<stats>+100 Ability Power<br>+10% Movement Speed</stats><br><br><unique>UNIQUE Passive - Echo:</unique> Gain charges upon moving or casting. At 100 charges, the next damaging spell hit expends all charges to deal 100 (+10% of Ability Power) bonus magic damage to up to 4 targets on hit.', 'Movement and casting builds charges that release chain lightning on next spell hit'),
	(2228, 3042, 'Muramana', '<stats>+25 Attack Damage<br><mana>+1000 Mana</mana></stats><br><br><mana><unique>UNIQUE Passive - Awe:</unique> Grants bonus Attack Damage equal to 2% of maximum Mana. Refunds 15% of Mana spent.</mana><br><mana><unique>UNIQUE Passive - Shock:</unique> Single target spells and attacks (on hit) on <font color=\'#FFFFFF\'>Champions</font> consume 3% of current Mana to deal bonus physical damage equal to twice the amount of Mana consumed.<br><br>This effect only activates while you have greater than 20% maximum Mana.</mana>', 'Movement and casting builds charges that release chain lightning on next spell hit'),
	(2229, 3041, 'Mejai\'s Soulstealer', '<stats>+20 Ability Power<br><mana>+200 Mana</mana></stats><br><br><unique>UNIQUE Passive - Dread:</unique> Grants +5 Ability Power per Glory. Grants 10% Movement Speed if you have at least 15 Glory.<br><unique>UNIQUE Passive - Do or Die:</unique> Grants 4 Glory for a champion kill or 2 Glory for an assist, up to 25 Glory total. Lose 10 stacks of Glory upon dying.', 'Grants Ability Power for kills and assists'),
	(2230, 3040, 'Seraph\'s Embrace', '<stats>+80 Ability Power<br><mana>+1000 Mana</mana></stats><br><br><mana><unique>UNIQUE Passive - Awe:</unique> Grants Ability Power equal to 3% of maximum Mana. Refunds 25% of Mana spent.</mana><br><active>UNIQUE Active - Mana Shield:</active> Consumes 20% of current Mana to grant a shield for 3 seconds that absorbs damage equal to 150 plus the amount of Mana consumed (120 second cooldown).', 'Grants Ability Power for kills and assists'),
	(2231, 3715, 'Skirmisher\'s Sabre', '<groupLimit>Limited to 1 Jungle item</groupLimit><br><br><stats>+10% Life Steal vs. Monsters<br><mana>+180% Base Mana Regen while in Jungle</mana></stats><br><br><passive>Passive - Challenging Smite:</passive> Smite can be cast on enemy champions, marking them for 4 seconds. While marked, the target is revealed, your basic attacks deal bonus true damage over 3 seconds, and their damage to you is reduced by 20%.<br><unique>UNIQUE Passive - Tooth / Nail:</unique> Basic attacks deal 25 bonus damage vs. monsters. Damaging a monster with a spell or attack steals 30 Health over 5 seconds. Killing monsters grants <font color=\'#99BBBB\'><a href=\'SpecialJungleExperience\'>special bonus experience</a></font>.', 'Lets your Smite mark Champions, giving you combat power against them.'),
	(2232, 1414, 'Enchantment: Runic Echoes', '<stats>+60 Ability Power<br>+7% Movement Speed</stats><br><br><unique>UNIQUE Passive - Echo:</unique> Gain charges upon moving or casting. At 100 charges, the next damaging spell hit expends all charges to deal 60 (+10% of Ability Power) bonus magic damage to up to 4 targets on hit.<br><br>This effect deals 250% damage to Large Monsters. Hitting a Large Monster with this effect will restore 18% of your missing Mana.', 'Grants Ability Power and periodically empowers your Spells'),
	(2233, 1413, 'Enchantment: Cinderhulk', '<stats>+400 Health<br>+15% Bonus Health</stats><br><br><unique>UNIQUE Passive - Immolate:</unique> Deals 7 (+2 per champion level) magic damage a second to nearby enemies while in combat. Deals 100% bonus damage to monsters. ', 'Grants Health and Immolate Aura'),
	(2234, 1412, 'Enchantment: Warrior', '<stats>+60 Attack Damage<br>+10% Cooldown Reduction</stats>', 'Grants Attack Damage and Cooldown Reduction'),
	(2235, 1410, 'Enchantment: Runic Echoes', '<stats>+60 Ability Power<br>+7% Movement Speed</stats><br><br><unique>UNIQUE Passive - Echo:</unique> Gain charges upon moving or casting. At 100 charges, the next damaging spell hit expends all charges to deal 60 (+10% of Ability Power) bonus magic damage to up to 4 targets on hit.<br><br>This effect deals 250% damage to Large Monsters. Hitting a Large Monster with this effect will restore 18% of your missing Mana.', 'Grants Ability Power and periodically empowers your Spells'),
	(2236, 3158, 'Ionian Boots of Lucidity', '<unique>UNIQUE Passive:</unique> +10% Cooldown Reduction<br><unique>UNIQUE Passive - Enhanced Movement:</unique> +45 Movement Speed<br><unique>UNIQUE Passive:</unique> Reduces Summoner Spell cooldowns by 10%<br><br><br><rules><font color=\'#FDD017\'>\'\'This item is dedicated in honor of Ionia\'s victory over Noxus in the Rematch for the Southern Provinces on 10 December, 20 CLE.\'\'</font></rules>', 'Increases Movement Speed and Cooldown Reduction'),
	(2237, 3036, 'Lord Dominik\'s Regards', '<stats>+50 Attack Damage</stats><br><br><unique>UNIQUE Passive - Giant Slayer:</unique> Grants up to +15% physical damage against enemy champions with greater maximum Health than you (+1.5% damage per 100 Health difference, maxing at 1000 Health difference).<br><unique>UNIQUE Passive - Last Whisper:</unique> +45% <a href=\'BonusArmorPen\'>Bonus Armor Penetration</a>', 'Overcomes enemies with high health and armor'),
	(2238, 3157, 'Zhonya\'s Hourglass', '<stats>+70 Ability Power<br>+45 Armor<br>+10% Cooldown Reduction</stats><br><br><active>UNIQUE Active - Stasis:</active> Champion becomes invulnerable and untargetable for 2.5 seconds, but is unable to move, attack, cast spells, or use items during this time (120 second cooldown).', 'Activate to become invincible but unable to take actions'),
	(2239, 1419, 'Enchantment: Bloodrazor', '<stats>+50% Attack Speed</stats><br><br><unique>UNIQUE Passive:</unique> Basic attacks deal 4% of the target\'s maximum Health in bonus physical damage (max 75 vs. monsters and minions) on hit.', 'Increases Attack Speed and deals damage based on the target\'s Health'),
	(2240, 3711, 'Tracker\'s Knife', '<groupLimit>Limited to 1 Jungle item</groupLimit><br><br><stats>+10% Life Steal vs. Monsters<br><mana>+180% Base Mana Regen while in Jungle</mana></stats><br><br><unique>UNIQUE Passive - Tooth / Nail:</unique> Basic attacks deal 25 bonus damage vs. monsters. Damaging a monster with a spell or attack steals 30 Health over 5 seconds. Killing monsters grants <font color=\'#99BBBB\'><a href=\'SpecialJungleExperience\'>special bonus experience</a></font>.<br><active>UNIQUE Active - Warding:</active> Consumes a charge to place a <font color=\'#BBFFFF\'>Stealth Ward</font> that reveals the surrounding area for 150 seconds. Holds up to 2 charges which refill upon visiting the shop. <br><br><rules>(A player may only have 3 <font color=\'#BBFFFF\'>Stealth Wards</font> on the map at one time. Unique Passives with the same name don\'t stack.)</rules>', 'Provides Stealth Wards over time'),
	(2241, 1418, 'Enchantment: Bloodrazor', '<stats>+50% Attack Speed</stats><br><br><unique>UNIQUE Passive:</unique> Basic attacks deal 4% of the target\'s maximum Health in bonus physical damage (max 75 vs. monsters and minions) on hit.', 'Increases Attack Speed and deals damage based on the target\'s Health'),
	(2242, 1416, 'Enchantment: Bloodrazor', '<stats>+50% Attack Speed</stats><br><br><unique>UNIQUE Passive:</unique> Basic attacks deal 4% of the target\'s maximum Health in bonus physical damage (max 75 vs. monsters and minions) on hit.', 'Increases Attack Speed and deals damage based on the target\'s Health'),
	(2243, 3170, 'Moonflair Spellblade', '<stats>+50 Ability Power<br>+50 Armor<br>+50 Magic Resist</stats><br><br><unique>UNIQUE Passive - Tenacity:</unique> Reduces the duration of stuns, slows, taunts, fears, silences, blinds, polymorphs, and immobilizes by 35%.', 'Improves defense and reduces duration of disabling effects'),
	(2244, 3057, 'Sheen', '<stats><mana>+250 Mana</mana><br>+10% Cooldown Reduction</stats><br><br><unique>UNIQUE Passive - Spellblade:</unique> After using an ability, the next basic attack deals bonus physical damage equal to 100% base Attack Damage on hit (1.5 second cooldown).', 'Grants a bonus to next attack after spell cast'),
	(2245, 3056, 'Ohmwrecker', '<stats>+300 Health<br>+50 Armor<br>+150% Base Health Regen <br>+10% Cooldown Reduction</stats><br><br><active>UNIQUE Active:</active> Prevents nearby enemy turrets from attacking for 3 seconds (120 second cooldown). This effect cannot be used against the same turret more than once every 8 seconds.<br><br><unique>UNIQUE Passive - Point Runner:</unique> Builds up to +20% Movement Speed over 2 seconds while near turrets (including fallen turrets) and Void Gates.', 'Temporarily disables enemy turrets'),
	(2246, 3175, 'Head of Kha\'Zix', '<unique>UNIQUE Active - Bonetooth Totem:</unique> Places a Stealth Ward that lasts 180 seconds (90 Second cooldown). Limit 3 Stealth Wards on the map per player.<br><br><unique>UNIQUE Passive - Mementos of the Hunt:</unique> Rengar collects trophies when killing Champions and gains bonus effects based on how many trophies he has. Kills and assists grant 1 trophy.<br><br><passive>3 Trophies:</passive> Rengar gains 25 Movement Speed whilst out of combat or in brush. <br><passive>6 Trophies:</passive> Increases the range of Rengar\'s Leap by 125.<br><passive>12 Trophies:</passive> Thrill of the Hunt\'s duration is increased by 5 seconds.<br><passive>20 Trophies:</passive> Rengar gains the movement speed bonus of Thrill of the Hunt while he is stealthed.', 'Temporarily disables enemy turrets'),
	(2247, 3053, 'Sterak\'s Gage', '<stats>+400 Health<br>+25% Base Attack Damage </stats><br><br><unique>UNIQUE Passive - Lifeline:</unique> Upon taking at least 400 to 1800 damage (based on level) within 5 seconds, gain a rapidly decaying Shield for 30% of your maximum Health for 8 seconds (60 second cooldown).<br><br><unlockedPassive>Sterak\'s Fury:</unlockedPassive> When <i>Lifeline</i> triggers, grow in size and strength, gaining +25% additional Base Attack Damage.', 'Shields against large bursts of damage'),
	(2248, 3174, 'Athene\'s Unholy Grail', '<stats>+40 Ability Power<br>+30 Magic Resist<br>+20% Cooldown Reduction<br><mana>+75% Base Mana Regen </mana></stats><br><br><unique>UNIQUE Passive:</unique> Gain 20% of the <a href=\'premitigation\'><font color=\'#6666FF\'><u>premitigation</u></font></a> damage dealt to champions as Blood Charges, up to <scaleLevel>100 - 250</scaleLevel>  max. Healing or shielding another ally consumes charges to heal them, up to the original effect amount.<br><unique>UNIQUE Passive - Harmony:</unique> Grants bonus % Base Health Regen equal to your bonus % Base Mana Regen.<br><br><rules>(Maximum amount of Blood Charges stored is based on level. Healing amplification is applied to the total heal value.)</rules>', 'Deal damage to empower your heals and shields'),
	(2249, 3052, 'Jaurim\'s Fist', '<stats>+15 Attack Damage<br>+150 Health</stats><br><br><unique>UNIQUE Passive:</unique> Killing a unit grants 5 maximum Health. This bonus stacks up to 30 times.', 'Attack Damage and stacking Health on Unit Kill'),
	(2250, 3050, 'Zeke\'s Harbinger', '<stats><mana>+250 Mana</mana><br>+30 Armor<br>+50 Ability Power<br>+10% Cooldown Reduction</stats><br><br><active>UNIQUE Active - Conduit:</active> Bind to target ally (60 second cooldown).<br><unique>UNIQUE Passive:</unique> When within 1000 units of each other, you and your ally generate Charges. Attacking or casting spells generates extra Charges. At 100 Charges, causing damage consumes them, increasing your and your ally\'s Ability Power by 20% and Critical Strike Chance by 50% for 8 seconds.<br><br><rules>(Champions can only be linked by one Zeke\'s Harbinger at a time.)</rules>', 'Grants an ally bursts of Critical Strike Chance and Ability Power'),
	(2251, 3048, 'Seraph\'s Embrace', '<stats>+80 Ability Power<br><mana>+1000 Mana</mana></stats><br><br><mana><unique>UNIQUE Passive - Awe:</unique> Grants Ability Power equal to 3% of maximum Mana. Refunds 25% of Mana spent.</mana><br><active>UNIQUE Active - Mana Shield:</active> Consumes 20% of current Mana to grant a shield for 3 seconds that absorbs damage equal to 150 plus the amount of Mana consumed (120 second cooldown).', 'Grants an ally bursts of Critical Strike Chance and Ability Power'),
	(2252, 3047, 'Ninja Tabi', '<stats>+30 Armor</stats><br><br><unique>UNIQUE Passive:</unique> Blocks 12% of the damage from basic attacks.<br><unique>UNIQUE Passive - Enhanced Movement:</unique> +45 Movement Speed', 'Enhances Movement Speed and reduces incoming basic attack damage'),
	(2253, 3060, 'Banner of Command', '<stats>+60 Armor<br>+30 Magic Resist<br><mana>+400 Mana</mana><br>+10% Cooldown Reduction</stats><br><br><active>UNIQUE Active - Promote:</active> Greatly increases the power of a lane minion and grants it immunity to magic damage (120 second cooldown).', 'Promotes a siege minion to a more powerful unit'),
	(2254, 3181, 'Sanguine Blade', '<stats>+45 Attack Damage<br>+10% Life Steal</stats><br><br><unique>UNIQUE Passive:</unique> Basic attacks grant +6 Attack Damage and +1% Life Steal for 8 seconds on hit (effect stacks up to 5 times).', 'Greatly increases Attack Damage and Life Steal'),
	(2255, 3068, 'Sunfire Cape', '<stats>+500 Health<br>+50 Armor  </stats><br><br><unique>UNIQUE Passive - Immolate:</unique> Deals 25 (+1 per champion level) magic damage per second to nearby enemies. Deals 50% bonus damage to minions and monsters.', 'Constantly deals damage to nearby enemies'),
	(2256, 3067, 'Kindlegem', '<stats>+200 Health  </stats><br><br><unique>UNIQUE Passive:</unique> +10% Cooldown Reduction', 'Increases Health and Cooldown Reduction'),
	(2257, 3187, 'Arcane Sweeper', '<stats>+225 Health<br>+250 Mana<br>+25 Armor<br>+20% Cooldown Reduction</stats><br><br><unique>UNIQUE Passive - Trap Detection:</unique> Grants <font color=\'#ee91d7\'>True Sight</font>  of nearby enemy traps.<br><active>UNIQUE Active - Hunter\'s Sight:</active> An arcane mist grants vision in the target area for 5 seconds, revealing enemy champions in the area for 3 seconds (60 second cooldown).', 'Activate to reveal a nearby area of the map'),
	(2258, 3065, 'Spirit Visage', '<stats>+500 Health<br>+55 Magic Resist<br>+200% Base Health Regen <br>+10% Cooldown Reduction</stats><br><br><unique>UNIQUE Passive:</unique> Increases all healing received by 25%.', 'Increases Health and healing effects'),
	(2259, 3185, 'The Lightbringer', '<stats>+30 Attack Damage<br>+30% Critical Strike Chance</stats><br><br><unique>UNIQUE Passive:</unique> Critical Strikes cause enemies to bleed for an additional 90% of bonus Attack Damage as magic damage over 3 seconds and reveal them for the duration.<br><unique>UNIQUE Passive - Trap Detection:</unique> Nearby stealthed enemy traps are revealed.<br><active>UNIQUE Active - Hunter\'s Sight:</active> A stealth-detecting mist grants vision in the target area for 5 seconds, revealing enemy champions that enter for 3 seconds (60 second cooldown).', 'Critical Strikes cause your target to bleed and be revealed'),
	(2260, 3184, 'Guardian\'s Hammer', '<stats>+150 Health<br>+15 Attack Damage<br>+10% Life Steal</stats><br><br><groupLimit>Limited to 1 Guardian\'s Item.</groupLimit>', 'Good starting item for attackers'),
	(2261, 3071, 'The Black Cleaver', '<stats>+400 Health<br>+40 Attack Damage<br>+20% Cooldown Reduction</stats><br><br><unique>UNIQUE Passive:</unique> Dealing physical damage to an enemy champion Cleaves them, reducing their Armor by 5% for 6 seconds (stacks up to 6 times, up to 30%).<br><unique>UNIQUE Passive - Rage:</unique> Dealing physical damage grants 20 movement speed for 2 seconds. Assists on Cleaved enemy champions or kills on any unit grant 60 movement speed for 2 seconds instead. This Movement Speed is halved for ranged champions.', 'Dealing physical damage to enemy champions reduces their Armor'),
	(2262, 3070, 'Tear of the Goddess', '<stats><mana>+250 Mana</mana></stats><br><br><mana><unique>UNIQUE Passive - Awe:</unique> Refunds 15% of Mana spent.<br><unique>UNIQUE Passive - Mana Charge:</unique> Grants 4 maximum Mana on spell cast or Mana expenditure (up to 2 times per 8 seconds).<br><br>Caps at +750 Mana.</mana>', 'Increases maximum Mana as Mana is spent'),
	(2263, 3191, 'Seeker\'s Armguard', '<stats>+30 Armor<br>+20 Ability Power</stats><br><br><unique>UNIQUE Passive:</unique> Killing a unit grants 0.5 bonus Armor and Ability Power. This bonus stacks up to 30 times.', 'Increases Armor and Ability Power'),
	(2264, 3190, 'Locket of the Iron Solari', '<stats>+30 Armor<br>+60 Magic Resist</stats><br><br><active>UNIQUE Active:</active> Grants a decaying shield to nearby allies for 2.5 seconds that absorbs up to 35 (+35 per level) damage (90 second cooldown).<br><br><rules>(Half effect if the target has been affected by another Locket of the Iron Solari recently.)</rules>', 'Activate to shield nearby allies from damage'),
	(2265, 3078, 'Trinity Force', '<stats>+250 Health<br><mana>+250 Mana</mana><br>+25 Attack Damage<br>+40% Attack Speed<br>+20% Cooldown Reduction<br>+5% Movement Speed</stats><br><br><unique>UNIQUE Passive - Rage:</unique> Basic attacks grant 20 Movement Speed for 2 seconds. Kills grant 60 Movement Speed instead. This Movement Speed bonus is halved for ranged champions.<br><unique>UNIQUE Passive - Spellblade:</unique> After using an ability, the next basic attack deals bonus physical damage equal to 200% of base Attack Damage on hit (1.5 second cooldown).', 'Tons of Damage'),
	(2266, 3077, 'Tiamat', '<stats>+20 Attack Damage<br>+50% Base Health Regen </stats><br><br><unique>UNIQUE Passive - Cleave:</unique> Basic attacks deal 20% to 60% of total Attack Damage as bonus physical damage to enemies near the target on hit (enemies closest to the target take the most damage).<br><active>UNIQUE Active - Crescent:</active> Deals 60% to 100% of total Attack Damage as physical damage to nearby enemy units (enemies closest to the target take the most damage) (10 second cooldown).', 'Melee attacks hit nearby enemies'),
	(2267, 3198, 'Perfect Hex Core', '<stats>+10 Ability Power per level<br>+25 Mana per level</stats><br><br><unique>UNIQUE Passive - Glorious Evolution:</unique> Viktor has reached the pinnacle of his power, upgrading Chaos Storm in addition to his basic spells.', 'Allows Viktor to improve an ability of his choice'),
	(2268, 3197, 'The Hex Core mk-2', '<stats>+6 Ability Power per level<br>+20 Mana per level</stats><br><br><unique>UNIQUE Passive - Progress:</unique> Viktor can upgrade one of his basic spells.', 'Allows Viktor to improve an ability of his choice'),
	(2269, 3075, 'Thornmail', '<stats>+100 Armor  </stats><br><br><unique>UNIQUE Passive:</unique> Upon being hit by a basic attack, reflects magic damage back to the attacker equal to 25% of your bonus Armor plus 15% of the incoming damage.<br><br><rules>(Bonus Armor is Armor from items, buffs, runes and masteries.)</rules><br><rules>(Reflect damage is calculated based on damage taken before being reduced by Armor.)</rules>', 'Returns damage taken from basic attacks as magic damage'),
	(2270, 3196, 'The Hex Core mk-1', '<stats>+3 Ability Power per level<br>+15 Mana per level</stats><br><br><unique>UNIQUE Passive - Progress:</unique> Viktor can upgrade one of his basic spells.', 'Allows Viktor to improve an ability of his choice'),
	(2271, 3074, 'Ravenous Hydra', '<stats>+75 Attack Damage<br>+100% Base Health Regen <br>+12% Life Steal</stats><br><br><passive>Passive:</passive> 50% of total Life Steal applies to damage dealt by this item.<br><unique>UNIQUE Passive - Cleave:</unique> Basic attacks deal 20% to 60% of total Attack Damage as bonus physical damage to enemies near the target on hit (enemies closest to the target take the most damage).<br><active>UNIQUE Active - Crescent:</active> Deals 60% to 100% of total Attack Damage as physical damage to nearby enemy units (closest enemies take the most damage) (10 second cooldown).', 'Melee attacks hit nearby enemies, dealing damage and restoring Health'),
	(2272, 3073, 'Tear of the Goddess (Quick Charge)', '<stats><mana>+250 Mana</mana></stats><br><br><mana><unique>UNIQUE Passive - Awe:</unique> Refunds 15% of Mana spent.<br><unique>UNIQUE Passive - Mana Charge:</unique> Grants 6 maximum Mana on spell cast or Mana expenditure (up to 2 times per 8 seconds).<br><br>Caps at +750 Mana.</mana>', 'Increases maximum Mana as Mana is spent'),
	(2273, 3072, 'The Bloodthirster', '<stats>+75 Attack Damage</stats><br><br><unique>UNIQUE Passive:</unique> +20% Life Steal<br><unique>UNIQUE Passive:</unique> Your basic attacks can now overheal you. Excess life is stored as a shield that can block 50-350 damage, based on champion level.<br><br>This shield decays slowly if you haven\'t dealt or taken damage in the last 25 seconds.', 'Grants Attack Damage, Life Steal and Life Steal now overheals'),
	(2274, 3748, 'Titanic Hydra', '<stats>+450 Health<br>+35 Attack Damage<br>+100% Base Health Regen </stats><br><br><unique>UNIQUE Passive - Cleave:</unique> Basic attacks deal 5 + 1% of your maximum health as bonus physical damage  to your target and 40 + 2.5% of your maximum health as physical damage  to other enemies in a cone on hit.<br><active>UNIQUE Active - Crescent:</active> Cleave damage to all targets is increased to 40 + 10% of your maximum health as bonus physical damage  in a larger cone for your next basic attack (20 second cooldown).<br><br><rules>(Unique Passives with the same name don\'t stack.)</rules>', 'Deals area of effect damage based on owner\'s health'),
	(2275, 3504, 'Ardent Censer', '<stats>+60 Ability Power<br>+10% Cooldown Reduction<br><mana>+50% Base Mana Regen </mana></stats><br><br><unique>UNIQUE Passive:</unique> +10% Heal and Shield Power<br><unique>UNIQUE Passive:</unique> +8% Movement Speed<br><unique>UNIQUE Passive:</unique> Your heals and shields on another allied champion grant them 20% - 35% Attack Speed and their attacks drain 20 - 35 health on-hit for 6 seconds.<br><br><rules>(This does not include regeneration effects or effects on yourself. Bonus effects are based on target\'s level.</rules>)</rules>', 'Shield and heal effects on other units grant them Attack Speed and their attacks drain life'),
	(2276, 3069, 'Talisman of Ascension', '<stats>+45 Armor<br>+150% Base Health Regen <br><mana>+75% Base Mana Regen <br></mana>+10% Cooldown Reduction</stats><br><br><unique>UNIQUE Passive - Point Runner:</unique> Builds up to +20% Movement Speed over 2 seconds while near turrets, fallen turrets and Void Gates.<br><unique>UNIQUE Passive - Favor:</unique> Being near a minion\'s death without dealing the killing blow grants 6 Gold and 10 Health.<br><active>UNIQUE Active:</active> Grants nearby allies +40% Movement Speed for 3 seconds (60 second cooldown).<br><br><groupLimit>Limited to 1 Gold Income Item.</groupLimit><br><br><rules><font color=\'#447777\'>\'\'Praise the sun.\'\' - Historian Shurelya, 22 September, 25 CLE</font></rules>', 'Increases Health / Mana Regeneration and Cooldown Reduction. Activate to speed up nearby allies.'),
	(2277, 3742, 'Dead Man\'s Plate', '<stats>+500 Health<br>+50 Armor</stats><br><br><unique>UNIQUE Passive - Dreadnought:</unique> While moving, build stacks of Momentum, increasing movement speed by up to 60 at 100 stacks. Momentum quickly decays while under the effects of a stun, taunt, fear, polymorph, or immobilize effect, and slowly decays while slowed.<br><unique>UNIQUE Passive - Crushing Blow:</unique> Basic attacks discharge all Momentum, dealing 1 physical damage per 2 stacks. If 100 stacks are discharged, damage is doubled and the target is slowed by 50% decaying over 1 second (melee only).<br><br><flavorText>\'\'There\'s only one way you\'ll get this armor from me...\'\' - forgotten namesake</flavorText>', 'Build momentum as you move around then smash into enemies.'),
	(2278, 3508, 'Essence Reaver', '<stats>+70 Attack Damage<br>+20% Critical Strike Chance</stats><br><br><unique>UNIQUE Passive:</unique> +10% Cooldown Reduction<br><unique>UNIQUE Passive:</unique> Gain increasingly more Cooldown Reduction from Critical Strike Chance provided by other sources (maximum +20% additional Cooldown Reduction at 30% Critical Strike Chance).<br><unique>UNIQUE Passive:</unique> Critical strikes restore 3% of your maximum Mana pool.', 'Critical Strike provides Cooldown Reduction and Mana');
